INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (1, 7865, 0, '10-days-in-africa', 'You have 10 DAYS IN AFRICA&trade; &ndash; touring by plane, car, and on foot. Chart your course from start to finish using destination and transportation tiles. With a little luck and clever planning, you just might outwit your fellow travelers. The first traveler to make correct connections for a ten-day journey wins the game.<br/><br/>Tiles are arranged on a player''s tray, then a new tile is drawn. It can be used to replace a tile on one of the &quot;days.&quot; Then that tile or the drawn tile are discarded face-up to one of three discard piles. Tiles may not be rearranged, only replaced.<br/><br/>You must complete your journey correctly, connecting by<br/>foot - bordering country tiles set side-by-side, <br/>air - countries of the same color with a same-colored airplane between them, or<br/>automobile - a car can drive between two countries and a third country which borders them.<br/><br/>Whoever is the first to connect all 10 days wins the game.<br/><br/>This is the second installment in the 10 Days in series.<br/><br/>', 2003, 2, 4, 10, 30, 20, 30, 1.3761, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (2, 22398, 0, '10-days-in-asia', 'From the back of the box:<br/><br/>You have 10 DAYS in ASIA - touring by train, airplane, ship, or on foot. Chart your course from start to finish using destination and transportation tiles. With a little luck and clever planning, you just might outmaneuver your fellow travelers. The first traveler to make connections for a ten day journey wins the game.<br/><br/>In this fourth installment of the 10 Days in series, the players are touring Asia, arranging their tiles on the ten days (open spots) of their trays to create a string of consecutive steps that, once completed, creates one consecutive journey. Tiles of neighboring countries may be placed side-by-side on the tray, with trains, ships and airplanes connecting distant countries depending on where they are located. Tiles cannot be rearranged in a tray, but must be replaced one at a time from the few face-up tiles available to all players, or from a random draw.<br/><br/>This installment introduces railroads which allow players to connect any countries that have stops along a selected rail line. These work in addition to the now-familiar airlines (connecting countries of the same color), and ocean liners (although now you have two oceans to contend with).<br/><br/>', 2007, 2, 4, 10, 25, 25, 25, 1.4286, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (3, 5867, 0, '10-days-in-europe', '&quot;There is much to be discovered in Europe! Many roads lead to success in this exciting travel game - you just have to find the right one. Exchange your cards cleverly and find your way through Europe quickly to win. Ten cards must show continuous travel either by land, sea or air.&quot;<br/><br/>Europa Tour (copyright 2002) is possibly the first in the 10 Days in series while 10 Days in Europe is the third installment in the 10 Days in series.<br/><br/>Gameplay<br/>All players pick tiles up one at a time, examining them and placing them onto any empty spot on their tile holders. Then, in turn, each player draws one tile and may replace one of their lined-up tiles with it. (Tiles may not be rearranged.) Tiles are drawn from one of the face-up discard piles or a face-down pile. The drawn card or replaced card is then discarded into one of the face-up piles. The first person to have all ten tiles satisfy the travel connection requirements wins.<br/><br/>Connection requirements:<br/>By Foot If a country is next to or connected to another country on the map, their tiles may be placed side-by-side<br/>By Air  Any two countries of the same color may be connected by an airplane of that color (its tile in between them)<br/>By Ship  If two countries can be linked by ship a ship can connect them (a ship tile placed between them)<br/><br/>Contents:<br/><br/>    60/7 cardboard tiles - 40/8 country tiles, 9/10 ship tiles and 5 pairs of plane tiles (in 5 colours)<br/>    4 trip planners (tile holders)<br/>    1 game board showing a map of Europe, each country depicted in one of 5 colors <br/><br/><br/>Differences between Europa Tour and 10 Days in Europe<br/><br/>    Europa Tour has 5 face-up discard piles, a board with 40 countries, 40 country tiles and 10 identical ship tiles. A ship can connect 2 countries joined by a dashed line.<br/>    10 Days in Europe has 3 face-up discard piles, a board with 42 countries, 48 country tiles (6 duplicates), 4 Atlantic, 3 Mediterranean and 2 Baltic ship tiles. If a sea or ocean borders two countries, a ship can connect them.<br/><br/><br/>', 2002, 2, 4, 10, 30, 20, 30, 1.3427, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (4, 7866, 0, '10-days-in-the-usa', 'You have 10 Days in the USA. Travel the country by jet, car, and on foot. Plan your trip from start to finish using destination and transportation tiles. With a little luck and clever planning, you just might outwit your fellow travelers.<br/><br/>This is the first installment in the 10 Days in series.<br/>                       <br/>There are 50 state tiles, 10 colored airplane tiles, and 6 car tiles. Players all flip tiles one at a time, examine them, and put them in the 10 &quot;days&quot; of their tile tray, in any order. Then in turn, they draw a tile from one of three face-up piles or a face-down pile. The new tile may replace one tile in their tray, with that tile (or the unused drawn tile) discarded onto any of the face-up piles. Alternatively, players may swap any two tiles in their tray. When a player has all their days connected correctly, they win the game.<br/><br/>Travel Connections:<br/>By Foot - bordering state tiles may be placed side-by-side<br/>By Automobile - states may be connected by driving through a third state which borders them both (the car tile is put between them)<br/>By Air - Two states of the same color may be connected by a same-color airplane placed between them&quot;<br/><br/>', 2003, 2, 4, 10, 30, 30, 30, 1.4, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (5, 424, 0, '1870-railroading-across-the-trans-mississippi-from-1870', 'This 18xx game takes the basic mechanics from Tresham''s 1829, and adds several new elements. Players seek to make the most money by buying and selling stock in various rail companies located on a map of central United States. The board itself is actually a fairly abstract hexagonal system, with track tiles placed on top of the hexes. Players buy and sell stock in various share companies, whose actions are controlled by the majority stockholder. The stock manipulation aspect of the game is widely-regarded as one of the best.  Plus each 18xx title adds new and different elements to the game.<br/><br/>This game features private companies with special money-making capabilities and sizeable map which encourages most (if not all) share companies to become profitable.  A game is finished when the bank runs out of money, and the player with the greatest personal holdings wins.<br/><br/>', 1992, 2, 6, 14, 360, 360, 360, 4.189, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (6, 980, 0, 'al-cabohne', 'Al Cabohne is a variant of Bohnanza for one or two players. Players compete against each other and against the &quot;Bean Mafia&quot;. Whoever makes the most profit selling beans wins (whether a player or the mafia).  There are three new bean types present, namely Stangenbohne, Puffbohne, and Kidneybohne - all of whom have beanometers which do not conform to the pattern present in the beanometers of the base game.<br/><br/>Al Cabohne is part of the Bohnanza family of games. It is now included in the stand-alone expansion Bohnanza: Ladies &amp; Gangsters.<br/><br/>', 2000, 1, 2, 12, 60, 60, 60, 1.7712, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (7, 6249, 0, 'alhambra', 'Granada, 1278. At the foot of the Sierra Nevada mountains, one of the most exciting and interesting project of the Spanish Middle Ages begins: the construction of the ALHAMBRA.<br/><br/>The best master builders in the whole of Europe and Arabia want to demonstrate their skill.  Employ the most suitable teams of builders and make sure that you always have enough of the right currency.  Because no matter whether they are stonemasons from the north or horticulturalists from the south, they all want a proper wage and insist on their &quot;native&quot; currency.  With their help towers can be constructed, gardens laid out, pavilions and arcades erected and seraglios and chambers built.<br/><br/>In Alhambra, players are acquiring buildings to be placed within their Alhambra complex.<br/><br/>The money in Alhambra comes in four different currencies and is available in the open money market.  The 54 buildings of six types become available for purchase in the building market four at a time; one building is available in each of the four different currencies.  On a player''s turn, a player may 1) take money from the open money market, 2) purchase a building from the building market and either place it in his Alhambra or reserve, or 3) engage in construction and re-construction projects with buildings that have been placed in the player''s Alhambra or reserve. The game rewards efficiency, as when a player purchases a building from the market for the exact amount of money, the player may take another turn.<br/><br/>Players with the most buildings in each of the six building types in his Alhambra score in each of the scoring phases, and points are awarded for players'' longest external &quot;wall&quot; section within their complex. The game ends when the building market can no longer be replenished from the building tile supply, and there is a final scoring, whereupon the player with the highest score wins.<br/><br/>Integrates with:<br/><br/>    Alhambra: The Dice Game (a variant in which you can combine Alhambra buildings with Alhambra dice.)<br/><br/><br/>', 2003, 2, 6, 8, 60, 45, 60, 2.1002, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (8, 48726, 0, 'alien-frontiers', 'Do you have what it takes to be a deep space colonist?  An alien frontier awaits the brave and daring!  This new planet will be harsh, but if you have the skills to manage your resources, build a fleet, research alien life, and settle colonies, the world can be yours.<br/><br/>Alien Frontiers is a game of resource management and planetary development for two to four players. During the game you will utilize orbital facilities and alien technology to build colony domes in strategic locations to control the newly discovered world.<br/><br/>The game board shows the planet, its moon, the stations in orbit around the planet, and the solar system&rsquo;s star. The dice you are given at the start of the game represent the space ships in your fleet. You will assign these ships to the orbital facilities in order to earn resources, expand your fleet, and colonize the planet.<br/><br/>As the game progresses, you will place your colony tokens on the planet to represent the amount of control you have over each territory. Those territories exert influence over specific orbital facilities and, if you control a territory, you are able to utilize that sway to your advantage.<br/><br/>The planet was once the home of an alien race and they left behind a wondrous artifact in orbit. Using your fleet to explore the artifact, you will discover amazing alien technologies that you can use to advance your cause.<br/><br/>Winning the game will require careful consideration as you assign your fleet, integrate the alien technology and territory influences into your expansion plans, and block your opponents from building colonies of their own. Do you have what it takes to conquer an alien frontier?<br/><br/>Roll and place your dice to gain advantages over your opponent and block them out of useful areas of the board.  Use Alien Tech cards to manipulate your dice rolls and territory bonuses to break the rules.  Steal resources, overtake territories, and do whatever it takes to get your colonies on the map first!  Don''t dream it''ll be easy, though, because the other players will be trying to do the same thing.<br/><br/>', 2010, 2, 4, 13, 90, 90, 90, 2.5673, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (9, 5404, 0, 'amun-re', 'Everyone knows of the pyramids on the Nile &mdash; eternal monuments of a powerful and beautiful culture that can still take our breath away. The players (leaders of a royal Egyptian family) choose their sites, build their pyramids, and thank Amun-Re and the other gods for their bounty.<br/><br/>In Amun-Re, each pharaoh wants to build the most pyramids. To accomplish this, they must first acquire a province where they can trade and farm. With their profits, they can buy new provinces and building-stones to erect pyramids. For all their actions players must make clever use of their power cards, and always offer appropriate sacrifices to Amun-Re.<br/><br/>', 2003, 3, 5, 12, 90, 90, 90, 3.0319, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (10, 8166, 0, 'anno-1503', 'A boardgame based on a computer game (instead of the other way around) and designed by Klaus Teuber, Anno 1503 views the era of colonization strictly from the home country perspective. Two to four players send ships to explore islands scattered about a 5 x 12 square ocean (the more players, the  more islands). The settlement of the new lands is, however, strictly abstract.<br/><br/>Each player''s turn begins with the roll of one 6-sided die. A &quot;6&quot; is a random event (pirates, fire or good fortune - bad twice as often as lucky, and most likely to damage players who are doing well). On other results, each player gains a commodity from one of his five workshops. The player who rolled may then buy commodities from the bank, sell them to his colonists for gold (no trading among players), or use them in various combinations to recruit new colonists, promote existing ones, or build ships. After that, ships can sail for the unknown lands.<br/><br/>Each island bears on its hidden side an outpost, a treasure or a trade agreement. After being discovered, these items are brought back to the home country (and the ship is removed from play, requiring the player to build a new one in order to keep searching). Outposts increase the productivity of workshops. Treasure yields either gold or free colonist promotions. Trade agreements reduce the gold needed to buy commodities from the bank.<br/><br/>Besides being useful in these ways, outposts, gold and agreements are among the game''s victory conditions. A player wins by being to first to attain three out of five objectives, namely, four outposts, 30 gold, three trade agreements, three colonists promoted to the top rank of &quot;merchant&quot; and the construction of four public buildings. The buildings (8 types, each bringing some advantage) cost nothing but don''t become available until a player has recruited at least four colonists. After that, each new colonist adds a building (unless they''ve been preempted by other players; there aren''t enough for everyone).<br/><br/>Overall, the game falls squarely into the &quot;simultaneous solitaire&quot; category. Except in the race for islands, the players scarcely interact at all. They do, however, have a great many choices to make in the course of play.<br/><br/>', 2003, 2, 4, 10, 90, 90, 90, 2.3379, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (11, 74, 0, 'apples-to-apples', 'The party game Apples to Apples consists of two decks of cards: Things and Descriptions. Each round, the active player draws a Description card (which features an adjective like &quot;Hairy&quot; or &quot;Smarmy&quot;) from the deck, then the other players each secretly choose the Thing card in hand that best matches that description and plays it face-down on the table. The active player then reveals these cards and chooses the Thing card that, in his opinion, best matches the Description card, which he awards to whoever played that Thing card. This player becomes the new active player for the next round.<br/><br/>Once a player has won a pre-determined number of Description cards, that player wins.<br/><br/>Note: &quot;Party Box&quot; editions include all cards from Apples to Apples: Expansion Set #1 and Apples to Apples: Expansion Set #2<br/><br/>', 1999, 4, 10, 12, 30, 30, 30, 1.1557, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (12, 27645, 0, 'apples-to-apples-party-box-expansion-one', 'From back of box:<br/><br/>The laughter continues as PARTY BOX EXPANSION ONE generates thousands of outrageous new comparisons!<br/><br/>This PARTY BOX EXPANSION has the same cards as the PARTY CRATE EXPANSION ONE.<br/><br/>Contains 576 Additional Cards!<br/><br/>Includes every card from Apples to Apples: Expansion Set #3 and Apples to Apples: Expansion Set #4 from the original Apples to Apples Core Game.<br/><br/>Part of the Apples to Apples Series.<br/><br/>', 2004, 4, 10, 12, 20, 20, 20, 1.2692, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (13, 342942, 0, 'ark-nova', 'In Ark Nova, you will plan and design a modern, scientifically managed zoo. With the ultimate goal of owning the most successful zoological establishment, you will build enclosures, accommodate animals, and support conservation projects all over the world. Specialists and unique buildings will help you in achieving this goal.<br/><br/>Each player has a set of five action cards to manage their gameplay, and the power of an action is determined by the slot the card currently occupies. The cards in question are:<br/><br/><br/>    CARDS: Allows you to gain new zoo cards (animals, sponsors, and conservation project cards).<br/>    BUILD: Allows you to build standard or special enclosures, kiosks, and pavilions.<br/>    ANIMALS: Allows you to accommodate animals in your zoo.<br/>    ASSOCIATION: Allows your association workers to carry out different tasks.<br/>    SPONSORS: Allows you to play a sponsor card in your zoo or to raise money.<br/><br/><br/>255 cards featuring animals, specialists, special enclosures, and conservation projects, each with a special ability, are at the heart of Ark Nova. Use them to increase the appeal and scientific reputation of your zoo and collect conservation points.<br/><br/>&mdash;description from the publisher<br/><br/>', 2021, 1, 4, 14, 150, 90, 150, 3.7357, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (14, 230802, 0, 'azul', 'Introduced by the Moors, azulejos (originally white and blue ceramic tiles) were fully embraced by the Portuguese when their king Manuel I, on a visit to the Alhambra palace in Southern Spain, was mesmerized by the stunning beauty of the Moorish decorative tiles. The king, awestruck by the interior beauty of the Alhambra, immediately ordered that his own palace in Portugal be decorated with similar wall tiles. As a tile-laying artist, you have been challenged to embellish the walls of the Royal Palace of Evora.<br/><br/>In the game Azul, players take turns drafting colored tiles from suppliers to their player board. Later in the round, players score points based on how they''ve placed their tiles to decorate the palace. Extra points are scored for specific patterns and completing sets; wasted supplies harm the player''s score. The player with the most points at the end of the game wins.<br/><br/>', 2017, 2, 4, 8, 45, 30, 45, 1.7613, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (15, 346965, 0, 'azul-queens-garden', 'Welcome back to the palace of Sintra! King Manuel I has commissioned the best garden designers of Portugal to construct the most extraordinary garden for his wife, Queen Maria of Aragon.<br/><br/>In Azul: Queen''s Garden, players are tasked with arranging a magnificent garden for the King''s lovely wife by arranging beautiful plants, trees, and ornamental features.<br/><br/>Using an innovative drafting mechanism, the signature of the Azul series, players must carefully select colorful tiles to decorate their garden. Only the most incredible garden designers will flourish and win the Queen''s blessing.<br/><br/>&mdash;description from the publisher<br/><br/>', 2021, 2, 4, 10, 60, 45, 60, 2.9554, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (16, 332613, 0, 'azul-summer-pavilion-glazed-pavilion', 'A brand new floor!<br/><br/>Azul: Glazed Pavilion offers players 2 newly designed player boards and matching scoring boards to compete over and a set of 4 overlays to keep Azul Glazed Pavilion tiles neatly organized. Offering the best of both worlds &mdash; beauty and new game elements &mdash; Glazed Pavilion is a must-have expansion for Azul fans!<br/><br/>&mdash;description from the publisher<br/><br/>', 2021, 2, 4, 8, 45, 30, 45, 2.0, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (17, 302388, 0, 'back-to-the-future-back-in-time', '&quot;Wait a minute, Doc, are you telling me you built a time machine...out of a DeLorean?&quot;<br/><br/>The photo of the McFly family is slowly fading... It''s 1955, and you''re wrapped up in a time paradox with Biff, Lorraine, George, and Doc Brown! Cooperate to move around Hill Valley to get the DeLorean ready, avoid Biff and his gang, help George and Lorraine fall in love, and crank the DeLorean up to 88 MPH &mdash; all just in time for the lightning to strike the Clock Tower, sending you back to the future!<br/><br/>In the fully co-operative game Back to the Future: Back in Time, each player takes on the role of a major character from the movie: Marty McFly, Doc Brown, Jennifer Parker, or Einstein the dog. The objective of the game is to have the characters move around 1955 Hill Valley, collecting certain items in an effort to fix Doc''s famous DeLorean time machine, defeat Biff Tannen and his gang of trouble-making friends, while ensuring that Marty''s parents fall in love. Only when that is accomplished can players then accelerate the DeLorean to 88 MPH down Main Street before the clock tower strikes 10:04 pm!<br/><br/>&mdash;description from the publisher<br/><br/>', 2020, 2, 4, 10, 50, 50, 50, 2.4062, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (18, 2397, 0, 'backgammon', 'Backgammon is a classic abstract strategy game dating back thousands of years. Each player has a set of 15 checkers (or stones) that must be moved from their starting positions, around, and then off the board. Dice are thrown each turn, and each player must decide which of their checkers to move based on the outcome of the roll. Players can capture each other''s checkers, forcing the captured checkers to restart their journey around the board. The winner is the first player to get all 15 checkers off the board. A more recent addition to the game is the &quot;doubling cube&quot;, which allows players to up the stakes of the game. Although the game relies on dice to determine movement, there is a large degree of strategy in deciding how to make the most effective moves given each dice roll and measuring the risk in terms of possible rolls the opponent may get.<br/><br/>Backgammon may be the first game to be mentioned in written history, going back 5,000 years to the Sumerians of ancient Mesopotamia. During the 1920s, archaeologists unearthed five boards from a cemetery in the ancient town of Ur. At another location, pieces and dice were also found along with the board. Boards from ancient Egypt have also been recovered from the tomb of Tutankhamun, including a mechanical dice box, no doubt intended to stop cheaters.<br/><br/>The names of the game were many. In Persia, Takhteh Nard which means &quot;Battle on Wood&quot;. In Egypt, Tau, which may be the ancestor of Senat. In Rome, Ludus Duodecim Scriptorum (&quot;game of twelve marks&quot;), later, Tabula (&quot;table&quot;), and by the sixth century, Alea (&quot;dice&quot;). In ancient China, T-shu-p-u and later in Japan, Sugoroko. The English name may derive from &quot;Bac gamen&quot; meaning &quot;Back Game&quot;, referring to re-entry of taken stones back to the board.<br/><br/>It was often enjoyed by the upper classes and is sometimes called &quot;The Aristocratic Game.&quot; The Roman Emperor Claudius was known to be such a fan that he had a set built into his coach so he could play as he traveled (the world''s first travel edition?).<br/><br/>The rules in English were standardized in 1743 by Edmond Hoyle. These remained popular until the American innovations of the 1930s.<br/><br/>', -3000, 2, 2, 8, 30, 30, 30, 2.0143, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (19, 5716, 0, 'balloon-cup', 'In Balloon Cup, the players compete in several short balloon flights (hops) to collect the colored cubes associated with each hop. Four landscape cards &ndash; two plains alternating with two mountains &ndash; are laid out, and 1, 2, 3, or 4 cubes in assorted colors (gray, blue, green, yellow, red) are added to these cards. From a hand of eight balloon cards, you must try to pass each landscape by adding cards matching the colored blocks onto their side of table, although winds (and cunning) may occasionally cause them to play on their opponent''s side &ndash; a move that can really ruin the opponent''s plans.<br/><br/>High-valued balloons are played on the mountains, and low-valued balloons are played on the plains. Whoever is the better balloonist takes the cubes from the card, which is then flipped over &ndash; mountains becomes plains and vice-versa &ndash; and refilled with cubes. Five trophy cards of value 3 to 7 are placed at the top of the cards. When a player has collected enough cubes of a given color, he earns the trophy card for that color. Players may even trade three otherwise useless cubes for one they can use. The first player to earn three trophy cards is the winner!<br/><br/>', 2003, 2, 2, 8, 30, 30, 30, 1.4595, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (20, 16395, 0, 'blokus-duo', 'Travel Blokus is the smaller, 2-player verson of Blokus. It is an abstract strategy game with transparent, tetris-shaped, colored pieces that players are trying to play onto the board. The only caveat to placing a piece is that it may not lie adjacent to your other pieces, but instead must be placed touching at least one corner of your pieces already on the board.<br/><br/>The tiles in the Blokus To Go version are made with square holes cut into them that allow them to be snapped onto square-shaped &quot;nubs&quot; on the playing field. There are also two storage trays that hold the tiles for travel. These trays cover the board when the game is not being played and fold open in order for players to access the tiles.<br/><br/>', 2005, 2, 2, 5, 15, 15, 15, 1.6861, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (21, 21550, 0, 'blokus-trigon', 'Blokus Trigon is an abstract strategy game from the makers of Blokus. The board pieces have changed from square to triangular. Game play is similar to Blokus, as players try to get rid of all their pieces.<br/><br/>There is a solitaire version where one player tries to get rid of all the pieces in a single sitting.<br/><br/>Components:<br/><br/>Hexagonal playing board with 486 triangles on the board<br/>4 sets of 22 pieces in red, blue, green and yellow<br/><br/>     1 piece made up of one triangle.<br/>     1 piece made up of two triangles.<br/>     1 piece made up of three triangles.<br/>     3 pieces made up of four triangles.<br/>     4 pieces made up of five triangles.<br/>     12 pieces made up of six triangles.<br/><br/><br/>', 2006, 2, 4, 7, 20, 20, 20, 1.9365, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (22, 11, 0, 'bohnanza', 'Bohnanza is the first in the Bohnanza family of games and has been published in several different editions, including a 2023 version with flowers.<br/><br/>In the game, you plant, then harvest bean cards in order to earn coins. Each player starts with a hand of random bean cards, and each card has a number on it corresponding to the number of that type of beans in the deck. Unlike in most other card games, you can''t rearrange the order of cards in hand, so you must use them in the order that you''ve picked them up from the deck &mdash; unless you can trade them to other players, which is the heart of the game.<br/><br/>On a turn, you must plant the first one or two cards in your hand into the &quot;fields&quot; in front of you. Each field can hold only one type of bean, so if you must plant a type of bean that''s not in one of your fields, then you must harvest a field to make room for the new arrival. This usually isn''t good! Next, you reveal two cards from the deck, and you can then trade these cards as well as any card in your hand for cards from other players. You can even make future promises for cards received right now! After all the trading is complete &mdash; and all trades on a turn must involve the active player &mdash; then you end your turn by drawing cards from the deck and placing them at the back of your hand.<br/><br/>When you harvest beans, you receive coins based on the number of bean cards in that field and the &quot;beanometer&quot; for that particular type of bean. Flip over 1-4 cards from that field to transform them into coins, then place the remainder of the cards in the discard pile. When the deck runs out, shuffle the discards, playing through the deck two more times. At the end of the game, everyone can harvest their fields, then whoever has earned the most coins wins.<br/><br/>The original German edition supports 3-5 players. The English version from Rio Grande Games comes with the first edition of the first German expansion included in a slightly oversized box. One difference in the contents, however, is that bean #22''s Weinbrandbohne (Brandy Bean) was replaced by the Wachsbohne, or Wax Bean. This edition includes rules for up to seven players, like the Erweiterungs-Set, but also adapts the two-player rules of Al Cabohne in order to allow two people to play Bohnanza.<br/><br/>', 1997, 2, 7, 12, 45, 45, 45, 1.6698, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (23, 16320, 0, 'bonnie-and-clyde', 'Number 5 in the Mystery Rummy series<br/><br/>Welcome to the 5th in a series of Mystery Rummy games, all created by Mike Fitzgerald!<br/><br/>Bonnie Parker and Clyde Barrow were notorious outlaws who robbed banks throughout the central United States between 1931 and 1935. Their exploits and charisma made them famous, and their story has been made into books and movies. Ted Hinton was the FBI agent charged with capturing them.<br/><br/>You are an FBI agent competing against other agents to see who can catch Bonnie and Clyde. The object of the game is to be the first to score 100 or more points.<br/><br/>There are two types of cards used in this game: Evidence (Location) cards and the Ted Hinton card. The game is played like the classic Rummy card game, with players playing melds and layoffs of Evidence cards to score points. The Ted Hinton card adds a strategic element to the game not found in traditional Rummy. After each hand, you total your points, and if no one has 100 or more points, you play another hand.<br/><br/>', 2009, 2, 4, 8, 45, 45, 45, 1.64, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (24, 355433, 0, 'boop', 'A deceptively cute, deceivingly challenging abstract strategy game for two players.<br/><br/>Every time you place a kitten on the bed, it goes &ldquo;boop.&rdquo; Which is to say that it pushes every other kitten on the board one space away. Line up three kittens in a row to graduate them into cats&hellip; and then, get three cats in a row to win.<br/><br/>But that isn&rsquo;t easy with both you AND your opponent constantly &ldquo;booping&rdquo; kittens around. It&rsquo;s like&hellip; herding cats!<br/>Can you &ldquo;boop&rdquo; your cats into position to win?<br/>Or will you just get &ldquo;booped&rdquo; right off the bed?<br/><br/><br/>     Approachable but challenging abstract game. Plays in 20 to 30 minutes.<br/>     Features a quilted, fabric board that lays over the back of the box, completing the miniature bed playing surface. 8 wood kittens and cats per player - 32 adorable cat pieces in all!<br/><br/><br/>', 2022, 2, 2, 10, 30, 20, 30, 1.3793, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (25, 171499, 0, 'cacao', 'Cacao is a tile-placement game that immerses players in the exotic world of the &quot;fruit of the Gods&quot;. As the chief of your tribe, you must lead your people to prosperity through the cultivation and trade of cacao &mdash; and to do that, you''ll need to put them to work in the best way possible.<br/><br/>In the game, each player has an individual deck of square worker tiles, with the number of workers on each side of the tile varying from tile to tile. The playing area starts with only a couple of jungle tiles in play: a cacao field and a small market; two jungle tiles are laid face up, and the remaining jungle tiles stacked as a draw pile.<br/><br/>On a player''s turn, he places one of her worker tiles on the board adjacent to one or more jungle tiles already in play, then (if two worker tiles are next to an empty space) adds one of the jungle tiles to the playing area in this space. Her workers then get busy and deliver the results of their effort: If you placed workers next to a cacao field, you receive one or two cacao markers per worker; if they''re next to a market, you can choose to sell one cacao marker per worker at the listed price; if next to a well, you receive water; if next to a temple, they stand and look good until the end of the game; and so on. He then refills her hand from her personal deck to three worker tiles.<br/><br/>Once all players have used all of their worker tiles, the game ends. Players score (or lose) points based on their water supply, and each temple rewards whichever players sent the most workers to it. In the end, whoever has collected the most gold wins.<br/><br/>', 2015, 2, 4, 8, 45, 45, 45, 1.8198, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (26, 214, 0, 'cafe-international', 'This game revolves around the placement of multi-national customers in a restaurant. The board shows many different tables, each with four chairs around them. The tables are grouped by nation, so the Chinese like to sit with other Chinese. However, some of the chairs are on the border between two nations, so a person from either place could occupy the seat. To further complicate this odd tile game, each of the people is either male or female, and tables must be gender-balanced.  As the game progresses some tiles become unplayable...<br/><br/>', 1989, 2, 4, 10, 60, 45, 60, 1.6528, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (27, 41, 0, 'cant-stop', 'In this Sid Sackson classic, players must press their luck with dice and choose combinations tactically to close out three columns. The board has one column for each possible total of two six-sided dice, but the number of spaces in each column varies: the more probable a total, the more spaces in that column and the more rolls it takes to complete. On their turn, a player rolls four dice and arranges them in duos: 1 4 5 6 can become 1+4 and 5+6 for 5 &amp; 11, 1+5 and 4+6 for 6 &amp; 10, or 1+6 and 4+5 for 7 &amp; 9. The player places or advances progress markers in the open column(s) associated with their chosen totals, then chooses whether to roll again or end their turn and replace the progress markers with markers of their color. A player can only advance three different columns in a turn and cannot advance a column which any player has closed out by reaching the end space; if a roll doesn&rsquo;t result in any legal plays, the turn ends with that turn&rsquo;s progress lost.<br/><br/>A predecessor from 1974, The Great Races, exists as a paper-and-pencil game.<br/><br/>', 1980, 2, 4, 9, 30, 30, 30, 1.1492, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (28, 12004, 0, 'candamir-the-first-settlers', 'Here''s a description of the game from AllGames4you:<br/><br/>With the new Catan-game &quot;The First Settlement&quot;, Klaus Teuber distances himself the most from the well-known game mechanics of the Settlers series.<br/><br/>Players take on the role of newcomers to Catan and learn how the adventurous life in the first settlement played itself out. They explore, using a new movement mechanic, for the raw materials they need to build the settlement. Along the way, they discover useful natural products - but also encounter wild animals and are confronted with adventurous situations. Those who survive these encounters obtain the raw materials they sought as well as experience points that improve the abilities of the player''s character. Over time, then, the player becomes stronger, smarter or more charismatic and is better and better suited for the dangers of the wild.<br/><br/>Back in the village, the natural products can be used to brew beverages while the raw materials are used for building. Through this building, the settlement grows and players obtain victory points.<br/><br/>The main attraction of the game lies in the exploration of the island and the development of the individual player characters. But trading and interaction between the players is also important.<br/><br/>Belongs to the Catan Series.<br/><br/>', 2004, 2, 4, 12, 120, 60, 120, 2.2356, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (29, 822, 0, 'carcassonne', 'Carcassonne is a tile-placement game in which the players draw and place a tile with a piece of southern French landscape on it. The tile might feature a city, a road, a cloister, grassland or some combination thereof, and it must be placed adjacent to tiles that have already been played, in such a way that cities are connected to cities, roads to roads, etcetera. Having placed a tile, the player can then decide to place one of their meeples on one of the areas on it: on the city as a knight, on the road as a robber, on a cloister as a monk, or on the grass as a farmer. When that area is complete, that meeple scores points for its owner.<br/><br/>During a game of Carcassonne, players are faced with decisions like: &quot;Is it really worth putting my last meeple there?&quot; or &quot;Should I use this tile to expand my city, or should I place it near my opponent instead, giving him a hard time to complete their project and score points?&quot; Since players place only one tile and have the option to place one meeple on it, turns proceed quickly even if it is a game full of options and possibilities.<br/><br/>First game in the Carcassonne series.<br/><br/>', 2000, 2, 5, 7, 45, 30, 45, 1.8964, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (30, 89952, 0, 'carcassonne-10-year-special-edition', 'The Spiel des Jahres-winning, genre-defining, spinoff-inducing tile-laying game Carcassonne turned ten in 2011. To mark the occasion, publisher Hans im Gl&uuml;ck released Carcassonne Jubil&auml;umsedition, a special edition of the game packaged in a giant blue meeple-shaped case that included: the original game; a meeple-shaped scoreboard; colored, translucent meeples; and the small expansion ''The Festival'' which comprises 10 new land tiles with their own special rules.<br/><br/>Part of the Carcassonne series of games.<br/><br/>', 2011, 2, 5, 8, 45, 45, 45, 2.0196, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (31, 2993, 0, 'carcassonne-expansion-1-inns-cathedrals', 'Carcassonne: Die Erweiterung (later prints used the title Inns &amp; Cathedrals) is the first major expansion for Carcassonne and introduces a few new aspects to the game.  There are a couple of completely new kinds of tiles - the inns and cathedrals.  There are also new tiles that present cities, roads, and cloisters in new shapes.  Additionally, each player gets a &quot;big meeple&quot; which counts as two regular meeples.  Another whole set of meeples means 6 players can now enjoy the game.  Finally, a set of scoring cards helps make score-keeping a little clearer.<br/><br/>Part of the Carcassonne series.<br/><br/>', 2002, 2, 6, 8, 60, 60, 60, 1.9273, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (32, 5405, 0, 'carcassonne-expansion-2-traders-builders', 'The second major expansion to the original game of Carcassonne, Traders &amp; Builders contains 24 tiles with new features such as Bridges and Cities.<br/><br/>Some tiles also feature symbols for the goods Wine, Cloth and Wheat. Players collect one of these goods when the feature that has it on the tile is scored. Players with the most of each type of good gets bonus points at the end of the game. There is a popular house rule that allows the trading of goods between players in exchange for other goods and the ability to choose where a tile is placed. There are also two new wooden playing pieces in this expansion.  The Builder is like a meeple in that it may be placed in a city or road as a kind of supervisor. A subsequent tile extension of the feature the Builder is in allows the player another tile placement. Farmers will also be able to place a new Pig pawn in a field for extra points at the end of the game.<br/><br/>Finally, Traders &amp; Builders comes with a large cloth bag. Not only does this make it easier to keep and handle the tiles, but it also removes the problem of having non-identical backsides.<br/><br/>Carcassonne: Traders &amp; Builders Expansion Play Summary<br/><br/><br/>     Traders - Some of the new city tiles depict goods: wine, grain and/or cloth. When you complete a city, your own or someone else''s, you collect a matching token for each good in the city. At game end, whoever has the most goods in each category scores an additional 10 points.<br/>     Builders - Each player receives a builder meeple in his color. You can add your builder to any city or road you already have in progress. Now anytime you add a tile to that city or road, you immediately get to take another turn. The builder does not count as a follower for determining control of a city or road.<br/>     Pig - You can add your pig to one of your farms to enrich its value. A farm with a pig scores 4 points per completed city served instead of the usual 3.<br/><br/><br/>Traders &amp; Builders is playable with or without the first expansion.<br/>Part of the Carcassonne series<br/><br/>Some versions of HiG Scandinavian release, blue box, has The River I included.<br/><br/>', 2003, 2, 6, 13, 60, 60, 60, 2.0614, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (33, 15158, 0, 'carcassonne-expansion-3-the-princess-the-dragon', 'In this third major expansion for the prize-winning Carcassonne, we move into the realm of fantasy.<br/>The land around Carcassonne is being visited by a dragon, making life very difficult for the followers. Brave heroes venture forth to face the danger, but without the aid of the fairies, their chances are not good.<br/>In the city, the princess seeks help from the knights, and farmers build secret passages to move about undetected by the dragon.<br/><br/>Contents: 30 new tiles with dragon nests, volcanoes, magic gates, and princesses; 1 large wooden dragon; 1 wooden fairy. Contrary to original reports, there are no princess figures in The Princess &amp; the Dragon.<br/><br/>Part of the Carcassonne series.<br/><br/>', 2005, 2, 6, 13, 60, 60, 60, 1.9949, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (34, 21385, 0, 'carcassonne-expansion-4-the-tower', 'The Tower is the fourth major expansion for the Carcassonne game.  Tower segments are added to the game, as well as some new actions.  Instead of placing a Meeple as usual on their turns, players can now either place a tower segment on a tile with a space for a tower, add a tower segment to a tower already standing, or place a Meeple on top of a tower (which &quot;finishes&quot; it).<br/><br/>Placing a tower segment allows you to capture other players'' Meeples, so long as they are in view of the tower in an orthogonal direction.  If the tower is 1 piece high, they can capture Meeples that are within 1 tile of the tower; if the tower is 2 pieces high, they can capture Meeples within 2 tiles of the tower; etc.  Not only do players lose whatever they may have scored with that Meeple, but they also have to pay 3 victory points if they want to free their Meeple.<br/><br/>Part of the Carcassonne series.<br/><br/>', 2006, 2, 6, 8, 60, 60, 60, 2.1653, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (35, 31784, 0, 'carcassonne-expansion-5-abbey-mayor', 'The fifth major expansion to Carcassonne, Abbey &amp; Mayor adds 3 new wooden piece types, 6 abbey tiles, and 12 landscape tiles. The Abbey tiles act as Cloisters but do not have to match adjacent tiles and they complete adjacent features when placed. Mayors can be placed only in cities, with their strength determined by the number of pennants in the city. Barns allow players to score fields during the game rather than just at the end. Wagons are placed on roads, cities, or cloisters, and can move to an adjacent open feature when their current feature is completed.<br/><br/>Part of the Carcassonne series.<br/><br/>Expands:<br/><br/>    Carcassonne<br/><br/><br/>', 2007, 2, 6, 8, 30, 30, 30, 2.0193, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (36, 33458, 0, 'carcassonne-expansion-6-count-king-robber', 'The sixth large expansion to Carcassonne released in Europe by Hans im Glck is actually a compilation of three existing small expansions and a new one.  Before Z-Man Games picked up the Carcassonne license, this compilation was only available in the US from Rio Grande Games as part of the Big Box 2, or each small expansion was available individually.<br/><br/>Part of the Carcassonne series.<br/><br/>This compilation contains:<br/><br/>    7 tiles out of Carcassonne: King & Scout (the King &amp; Scout tiles extending Carcassonne: Hunters and Gatherers are not included in this expansion)<br/>    Carcassonne: The Count of Carcassonne<br/>    Carcassonne: The River II<br/>    Carcassonne: The Cult, which was first made available in this compilation.<br/><br/><br/>', 2007, 2, 6, 8, 45, 30, 45, 2.1842, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (37, 38855, 0, 'carcassonne-expansion-7-the-catapult', 'The seventh &quot;large&quot; expansion for Carcassonne.<br/>12 new tiles with a faire symbol are added to the game. When a player draws a faire tile, they place it and then a &quot;catapult round&quot; begins. <br/>For the first time, action/dexterity is added to the Carcassonne series. In a catapult round, players attempt to launch special tokens with the wooden catapult. Players have one each of four different kinds of tokens that determine what kind of catapult action is to be taken:  Knock out tokens try to remove meeples; Seduction tokens try to swap meeples; Target tokens try to hit the faire tile; Catch tokens must be caught for points.<br/><br/>Expands:<br/><br/>    Carcassonne<br/><br/><br/>', 2008, 2, 6, 8, 45, 30, 45, 1.3704, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (38, 7707, 0, 'carcassonne-king-scout', 'This bundle of two separate expansions contains 7 tiles for the original Carcassonne (King) and 5 tiles for Carcassonne: Hunters &amp; Gatherers (Scout).<br/><br/>The 7 tiles from The King half of this expansion are also available in Carcassonne: Expansion 6  Count, King & Robber.<br/><br/>Part of the Carcassonne series.<br/><br/>', 2003, 2, 5, 8, 45, 45, 45, 1.7982, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (39, 12902, 0, 'carcassonne-the-city', 'Carcassonne: The City is a standalone game in the Carcassonne series. Players build up the old town together by placing tiles. While the town area grows, the town walls grow around it, starting from a wooden gate. The wall is comprised of delicately carved wooden parts, that create a beautiful rendition of the medieval town at the end of the game.<br/><br/>Next to the slightly modified tile-laying rules, players have the possibility to place their followers as guards on the walls, offering them a wide view of the town. This brings the players extra points. Each player also receives between three and six cylindrical wooden towers (depending on the number of players), giving the town walls an added aesthetic effect.<br/><br/>', 2004, 2, 4, 8, 45, 30, 45, 2.2627, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (40, 12903, 0, 'carcassonne-the-count-of-carcassonne', 'Der Graf von Carcassonne (The Count of Carcassonne) is another expansion to the well-known series. It contains a further twelve tiles plus the count (a nice wooden figure). The tiles depict the town Carcassonne itself, which is visited by the Count. When a player places a tile that causes scoring for other players but not for themselves, they may put a follower in one of the four regions of the city.  They may also move the Count to a region, imprisoning all followers in that region.  Each region corresponds to a scoring method, and when a feature of that type is scored, the player may move their follower to that feature, to share in the scoring or even prevent another player from scoring! This expansion requires the basic Carcassonne game, and can be combined with any of the other expansions. (from <a target=''_blank'' href="http://www.spielbox.de" rel="nofollow noreferrer noopener">www.spielbox.de</a>)<br/><br/>Availability:<br/><br/>     The Count can be purchased in many places as an independent expansion.<br/>     The Count is also available in Carcassonne: Expansion 6  Count, King & Robber.<br/><br/><br/>Part of the Carcassonne series.<br/><br/>', 2004, 2, 6, 8, 60, 60, 60, 2.0059, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (41, 89953, 0, 'carcassonne-the-dice-game', 'They said it couldn''t be done &ndash; oh, wait, no one ever said that. In fact, gamers have been predicting the release of this title for at least five years, and now is the time.<br/><br/>As part of the tenth anniversary celebrations for the Spiel des Jahres-winning Carcassonne, publisher Hans im Gl&uuml;ck and designers Klaus-J&uuml;rgen Wrede and Olivier Lamontagne are releasing Carcassonne: The Dice Game, a quick-playing dice game that will allow players to build cities faster than ever before. The game includes nine special dice, a pencil and a block of scoresheets packaged inside a meeple-shaped metal container.<br/><br/>', 2011, 2, 5, 8, 10, 10, 10, 1.1087, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (42, 123905, 0, 'carcassonne-the-festival', 'This mini-expansion for Carcassonne comprises 10 tiles marked with a 10th anniversary icon. When placed, the tiles allow a player to place a follower as normal, or return a follower currently on the board back to their supply.<br/><br/>This expansion was originally packaged with Carcassonne: 10 Year Special Edition, but was also sold separately by some retailers.<br/><br/>Part of the Carcassonne series of games.<br/><br/>The Festival II has the same tiles as the 10th anniversary edition, but are marked with a 15th anniversary icon. The tiles have the new artwork.<br/><br/>', 2011, 2, 6, 13, 45, 45, 45, 1.7368, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (43, 92332, 0, 'carcassonne-the-phantom', 'Carcassonne: The Phantom consists of 6 transparent phantoms in 6 colors. The purple phantom is for the gray player.<br/><br/>Rules <br/>Each player gets a phantom of his player color. When placing a follower on a tile, the player may also place his phantom as an additional follower on the same tile. When both the follower and the phantom occupy the same tile, they must be placed on two different features. When the player gets his phantom back from scoring, he may keep it to use in a later turn. The phantom can also be placed by itself, and always counts as a regular follower.<br/><br/>Carcassonne: The Phantom will be available in German beginning in March 2011, with a worldwide release in April. The set will be released in 36-expansion boxes with 6 different colored transparent meeple-shaped boxes to choose from.<br/><br/>Part of the Carcassonne series.<br/><br/>', 2011, 2, 6, 8, 45, 45, 45, 1.5902, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (44, 2591, 0, 'carcassonne-the-river', 'Der Fluss (The River) is a mini-expansion for Carcassonne. It adds twelve river tiles. All the familiar landscape elements are also present.<br/><br/>The river tiles are placed first, after that the game continues as normal. No followers may be placed on the river so the scoring is the same as in the basic game.<br/><br/>Part of the Carcassonne series.<br/><br/>', 2001, 2, 5, 8, 45, 30, 45, 1.6929, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (45, 18836, 0, 'carcassonne-the-river-ii', 'The River II (Der Fluss II) is a mini-expansion for Carcassonne. It adds twelve tiles with a river and has some differences with the first River expansion because the tiles are designed to combine with the first three expansions for Carcassonne, Inns &amp; Cathedrals, Traders &amp; Builders and The Princess &amp; the Dragon.  The River II is contained in Carcassonne: Expansion 6  Count, King & Robber<br/><br/>The river tiles are placed first, after that the game continues as normal. <br/>Part of the Carcassonne series.<br/><br/>Expands:<br/><br/>    Carcassonne<br/><br/><br/>', 2005, 2, 6, 8, 60, 60, 60, 1.6997, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (46, 655, 0, 'castle', 'Bruno Faidutti revisits the medieval setting of Ohne Furcht und Adel with the card game Castle. Players are given a set of square cards which are to be played onto the table, which has a cardboard castle battlement layout. Cards are played into one of four regions: in the courtyard, on the battlements, on the towers, or outside the castle. And when played, the cards will usually allow you to take some sort of special action, which is unique to the card you played. The first player to rid himself of all his cards wins, which can be a tricky proposition at best.<br/><br/>A winner of the 2000 Concours International de Crateurs de Jeux de Socit.<br/><br/>', 2000, 2, 5, 14, 30, 30, 30, 1.9048, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (47, 278, 0, 'catan-card-game', 'Catan Card Game bears only a slight resemblance to The Settlers of Catan, the original game in the Catan series.  There are six resources: wool, wood, bricks, grain, ore, and gold. Before beginning the game, the players receive six square cards showing the resources, with a different die number on each card. In addition, the players start the game with two village cards and a road card connecting them. There are card stacks of more roads and villages, as well as cities, to be purchased during the game. With each new village or city comes two new resource cards. Villages and cities give victory points.<br/><br/>When the number die is rolled, instead of collecting more cards, the players rotate the corresponding card 90 degrees to indicate a gain of one more of that resource; i.e., the brick card shows a picture of one brick on one edge of the card, two bricks on the next clockwise edge, three bricks along the third edge, and zero bricks on the fourth edge. There is also an event die, with five possible outcomes:<br/><br/><br/>     a reward for the player with more knight points or more ''windmill'' points (a picture of a windmill on some cards),<br/>     a bonus resource,<br/>     an attack if a player has too many resources, and<br/>     one of six special events - civil war, conflict, master builder, plague, productive year, or progress.     <br/><br/><br/>There are 62 expansion cards in six stacks in the center of the table. Before beginning the game, players choose one stack, go through it, and choose three cards to hold in their hands. Forty-two of the expansion cards require spending resources to be put into play, gaining civic improvements or knights. Every civic improvement serves some useful function or adds victory points or both. Twenty of the cards are actions benefiting one of the players or harming the other. After a player pays to put a card down or uses an action card, he blindly draws a replacement. Unwanted or unusable cards can be traded in future turns. Some of the cards have flags on them, indicating victory points.<br/><br/>Whoever first has twelve victory points wins the game!<br/><br/>The Anniversary edition of this game (Jubil&auml;umsausgabe, tin box edition) can be found under a separate game entry due to some differences in content: Die Siedler von Catan: Das Kartenspiel  10th Anniversary Special Edition Tin Box.<br/><br/>Belongs to the Catan Series.<br/><br/>', 1996, 2, 2, 10, 120, 60, 120, 2.4403, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (48, 325, 0, 'catan-seafarers', 'This is an expansion for The Settlers of Catan. Players can build shipping lanes, which are very similar to roads. Additionally, the game comes with many different water-hex-heavy variant setups. The American version (Mayfair) should only be used with the American base game, instead of the German one (Kosmos), because of matching components and for the same reason, the Kosmos German version should only be used with the German base game. Additionally, several different editions exist; 5th edition is the most recent. Editions should only be used with same edition, otherwise the purchase of adapter kit is required.<br/><br/>Part of the Catan Series.<br/><br/>This game requires The Settlers of Catan.  Ideally, using the same publisher and edition of the game.<br/><br/>', 1997, 3, 4, 10, 90, 90, 90, 2.3837, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (49, 18602, 0, 'caylus', 'Once upon a time ...<br/>1289. To strengthen the borders of the Kingdom of France, King Philip the Fair decided to have a new castle built. For the time being, Caylus is but a humble village, but soon, workers and craftsmen will be flocking by the cartload, attracted by the great prospects. Around the building site, a city is slowly rising up.<br/><br/>The players embody master builders. By building the King''s castle and developing the city around it, they earn prestige points and gain the King''s favor. When the castle is finished, the player who has earned the most prestige wins the game.  The expansion Caylus Expansion: The Jeweller was included in the 2nd Edition.<br/><br/>Each turn, players pay to place their workers in various buildings in the village. These buildings allow players to gather resources or money, or to build or upgrade buildings with those resources. Players can also use their resources to help build the castle itself, earning points and favors from the king, which provide larger bonuses. Building a building provides some immediate points, and potentially income throughout the game, since players receive bonuses when others use their buildings. The buildings chosen by the players have a heavy impact on the course of the game, since they determine the actions that will be available to all the players.<br/><br/>As new buildings are built, they stretch along a road stretching away from the castle, and not all buildings can be used every turn. Players have some control over which buildings are active by paying to influence the movement of the Provost marker. The final position of the marker is the newest building that can be used that turn. The Provost marker also helps determine the movement of the Bailiff marker, which determines the end of the game. Generally, if players are building many buildings and the Provost is generous in allowing them to be used, the game ends more quickly.<br/><br/>', 2005, 2, 5, 12, 150, 60, 150, 3.7976, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (50, 27364, 0, 'caylus-magna-carta', 'The general theme and mechanics of Caylus Magna Carta are similar to the Caylus board game. However, there is no board or score track and the tactical nuts and bolts of the game are somewhat different. In terms of components, the game consists of cards, money, worker pawns, resource markers, the provost, and castle building stones. Each player has a set of identical cards, which are shuffled and used as a face-down draw deck. Players start with an opening random draw of cards, and on his turn a player can either:<br/><br/><br/>    extend the road by building a new building <br/>    pay 1 to draw a new building card <br/>    pay 1 to discard his hand and draw a fresh hand (with the discard deck being shuffled for a new draw deck once the draw deck is exhausted) <br/>    pay 1 to place a worker on one of the existing building cards <br/>    build one of the common prestige building cards (some of which are placed at the beginning of the game as part of the setup) or <br/>    pass<br/><br/><br/>Once everyone has passed, the cards are resolved up to the provost (which can be moved in passing order by paying money).<br/><br/>Ownership of the non-common buildings is shown by the card color. When a worker is placed on a card, the owner earns either resources or money as a reward instead of victory points. Players may also choose to help build the castle. Starting with the first player to have passed, players can pay resources to obtain castle stones. The stones are worth three different values (2-4 points). Players collect the most valuable ones first. In addition, the player who collects the most building stones each round is rewarded with a gold resource marker.<br/><br/>From round to round, 1st player privileges rotate to the left, and the provost starts two cards further down the path from the castle.<br/><br/>The winner of the game is the player who has accumulated the most victory points once the game end has been triggered the turn the castle is finished. Victory points are awarded for castle stones, cards built, and resources and money in hand at the end of the game.<br/><br/>', 2007, 2, 4, 10, 75, 45, 75, 2.8704, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (51, 209685, 0, 'century-spice-road', 'Century: Spice Road is the first in a series of games that explores the history of each century with spice-trading as the theme for the first installment.  In Century: Spice Road, players are caravan leaders who travel the famed silk road to deliver spices to the far reaches of the continent for fame and glory. Each turn, players perform one of four actions:<br/><br/><br/>     Establish a trade route (by taking a market card)<br/>     Make a trade or harvest spices (by playing a card from hand)<br/>     Fulfill a demand (by meeting a victory point card''s requirements and claiming it)<br/>     Rest (by taking back into your hand all of the cards you''ve played)<br/><br/><br/>The last round is triggered once a player has claimed their fifth victory point card, then whoever has the most victory points wins.<br/><br/>', 2017, 2, 5, 8, 45, 30, 45, 1.8003, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (52, 815, 0, 'chrononauts', 'In Chrononauts, each player becomes a time traveler, with a unique identity and a secret mission. During the game, players travel backwards and forwards through history, doing all those things people have always dreamed of using a time machine to do: Visiting the great moments of the past, peeking into the future, collecting up impossible artifacts and priceless works of art (at the moment just before history records their destruction), coming to grips with the paradoxes of time travel, and of course, changing pivotal events and altering the course of history itself. How would the timeline be different if Lincoln and JFK had not been assassinated? And is that the version of reality that you came from originally...the one you must return to in order to win? It''s all packed into a fast and easy Fluxx-style card game that will take you to the beginning of time and back again.<br/><br/>', 2000, 1, 6, 11, 30, 30, 30, 1.8505, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (53, 205398, 0, 'citadels', 'In Citadels, players take on new roles each round to represent characters they hire in order to help them acquire gold and erect buildings. The game ends at the close of a round in which a player erects their eighth building. Players then tally their points, and the player with the highest score wins.<br/><br/>Players start the game with a number of building cards in their hand; buildings come in five colors, with the purple buildings typically having a special ability and the other colored buildings providing a benefit when you play particular characters. At the start of each round, the player who was king the previous round discards one of the eight character cards at random, chooses one, then passes the cards to the next player, etc. until each player has secretly chosen a character. Each character has a special ability, and the usefulness of any character depends upon your situation, and that of your opponents. The characters then carry out their actions in numerical order: the assassin eliminating another character for the round, the thief stealing all gold from another character, the wizard swapping building cards with another player, the warlord optionally destroys a building in play, and so on.<br/><br/>On a turn, a player earns two or more gold (or draws two building cards then discards one), then optionally constructs one building (or up to three if playing the architect this round). Buildings cost gold equal to the number of symbols on them, and each building is worth a certain number of points. In addition to points from buildings, at the end of the game a player scores bonus points for having eight buildings or buildings of all five colors.<br/><br/>The 2016 edition of Citadels includes twenty-seven characters &mdash; eight from the original Citadels, ten from the Dark City expansion, and nine new ones &mdash; along with thirty unique building districts, and the rulebook includes six preset lists of characters and districts beyond the starter list, each crafted to encourage a different style and intensity of gameplay.<br/><br/>', 2016, 2, 8, 10, 60, 30, 60, 2.0385, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (54, 13291, 0, 'citadels-the-dark-city', 'An expansion for the German edition of the game. It included all the elements featured in the US and the 2nd French edition (new characters and districts), and some more stuff.<br/><br/>The Quarry allows you to build districts identical with districts you already have. The Imperial Treasury and the Fountain of Youth give you point bonuses at the end of the game. A bonus equal to the gold you own for the Imperial Treasury, a bonus equal to the number of purple buildings in your city for the Wish Fountain.<br/><br/>This expansion is now provided with the 3rd Edition of Citadels.<br/><br/>', 2004, 2, 8, 10, 60, 60, 60, 2.1, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (55, 632, 0, 'cloud-9', 'Cloud 9 - The Daring Game of Ups and Downs<br/><br/>Players earn points by daring to stay in the basket of a hot air balloon as it rises. Points increase as the balloon climbs from cloud to cloud, but so does the risk of the balloon falling. Should you jump out to save your points or trust that the pilot will take you safely higher?<br/><br/>Everyone places their passenger token into the balloon''s basket to start the trip, and receives a hand of six balloon cards. Then, each turn, a different &quot;pilot&quot; rolls an increasing number of specialized dice to see if the balloon can stay aloft. The dice dictate how many of the balloon cards are needed of each color. (There are also optionally played Wild Cards to keep everyone guessing.) Each player decides whether they think the pilot will have the cards to successfully take the balloon up, or whether they should jump out and keep the points earned so far. If they stay, they run the risk of getting no points if the pilot fails. If the balloon does fall, it is placed back on the lowest cloud. Everyone hops aboard and draws one new card, and the next trip begins. When a player earns 50 points the game is over.<br/><br/>', 1999, 3, 6, 8, 30, 20, 30, 1.1527, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (56, 224037, 0, 'codenames-duet', 'Codenames Duet keeps the basic elements of Codenames &mdash; give one-word clues to try to get someone to identify your agents among those on the table &mdash; but now you''re working together as a team to find all of your agents. (Why you don''t already know who your agents are is a question that Congressional investigators will get on your back about later!)<br/><br/>To set up play, lay out 25 word cards in a 5&times;5 grid. Place a key card in the holder so that each player sees one side of the card. Each player sees a 5&times;5 grid on the card, with nine of the squares colored green (representing your agents) and three squares colored black (representing assassins). Three of the nine squares on each side are also green on the other side, one assassin is black on both sides, one is green on the other side and the other is an innocent bystander on the other side.<br/><br/>Collectively, you need to reveal all fifteen agents &mdash; without revealing an assassin &mdash; before time runs out in order to win the game. Either player can decide to give the first one-word clue to the other player, along with a number. Whoever receives the clue places a finger on a card to identify that agent. If correct, they can attempt to identify another one. If they identify a bystander, then their guessing time ends. If they identify an assassin, you both lose! Unlike regular Codenames, they can keep guessing as long as they keep identifying an agent each time; this is useful for going back to previous clues and finding ones they missed earlier. After the first clue is given, players alternate giving clues.<br/><br/>', 2017, 2, 2, 11, 30, 15, 30, 1.3636, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (57, 5782, 0, 'coloretto', 'Game play in Coloretto is simple: Either draw a card to play to a row, or take a row of cards to add them to your collection. A row can have at most three cards, so at some point everyone is forced to take a row. Once all the rows have been claimed, players start a new round, drawing or taking once again.<br/><br/>What are you trying to do with these cards? Collect huge sets - but only in three colors as every color beyond the third will cost you points. Jokers are highly-prized as they always match what you want, and +2 cards provide sure points, giving you a back-up plan if everything goes south in terms of the colors you''re collecting.<br/><br/>Once only a few cards remain in the deck, the round ends and everyone tallies their score, choosing three colors of cards to score positively while any other colors count against you. Each color is scored using a triangular number system: the first card in a color is &plusmn;1 point, the second card is &plusmn;2 points, and so on. The player with the high score wins!<br/><br/>A two-player variant is included with some versions of Coloretto, with the only change being that rows can have only 1-3 cards placed in them, depending on the icons on the row cards.<br/><br/>Nordic version include extensions: ''Coloretto: The Extra Cards'', ''Coloretto: The Limit Cards'' and ''Coloretto for two players''.<br/><br/>', 2003, 2, 5, 8, 30, 30, 30, 1.2761, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (58, 2398, 0, 'cribbage', 'Cribbage is a card game invented in the early 17th century, based on the earlier game Noddy. It is played with a deck of standard playing cards and a signature piece of equipment called the cribbage board.  Cribbage is traditionally played as a 2 player game.<br/><br/>In the version usually played today, each player is dealt a hand of 6 cards, from which they discard 2 into a special pile called the Crib.  One card is then cut from the draw pile and turned face up - it is considered part of each player''s hand and of the Crib.  The players then play cards in turn, scoring points for hitting certain totals, or for making sets or sequences.  Score is kept by moving pegs along tracks on the cribbage board.  This is repeated until both players have exhausted their hand of cards.<br/><br/>Next, each player picks up their hand and determines all possible scoring combinations, pegging points again on the cribbage board.  The dealer then picks up the Crib and scores it for all possible points.  Then the cards are shuffled and the deal alternates.  The winner is the first to reach 121 points.<br/><br/>The origin date listed for this game is approximate.<br/><br/>', 1630, 2, 6, 10, 30, 30, 30, 1.9031, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (59, 30380, 0, 'cuba', 'Game description from the publisher:<br/><br/>Cuba prior to the revolution: Under turbulent circumstances, the villages of the island strive for independent wealth and influence. Who can buy and sell his products and goods on the domestic market profitably or take in the most on the trading ships? Who can send the right delegate to parliament in order to influence the government legislative process, or erect distilleries, hotels and banks at the right moment to the benefit of his village?<br/><br/>Whoever has accumulated the most victory points in Cuba by the end of the game wins. Players earn victory points by shipping merchandise from the harbor, but also by erecting and using buildings, and by abiding by the law.<br/><br/>', 2007, 2, 5, 10, 120, 75, 120, 3.263, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (60, 8946, 0, 'da-vinci-code', 'From the box:<br/><br/>Conceal your secret code, outguess your opponent, deduce the solution, amaze your foes.  In the game of CODA players try to crack each other''s &quot;code&quot; - a sequence of secret numbers.  Guess an opponent''s secret number and it is revealed (by knocking it down).  Guess incorrectly and you must reveal one of your own secret numbers!  On each turn, a new number enters play, which helps you to narrow the possibilities and grow your own code.  Common sense, intuition and your &quot;detective&quot; skills will guide you to success.<br/><br/>From me:<br/><br/>There are two sets of tiles (similar to Stratego pieces without the soldiers) numbered 0-11.  One set is black, one is white.  In four player game, everyone one grabs three random pieces and arranges them in numeric order, with white pieces going to the right on ties.  In order a player grabs one of the remaining tiles and guesses on of the opponents pieces.  If correct, that piece is revealed. If the player is incorrect the piece that was just drawn is placed in the correct place in his own sequence and revealed.  If the player was correct in guessing he MAY make another guess.  If he chooses not to then he places the picked piece in his code, in sequence, but does not reveal it.<br/><br/>Play continues until only one person has a piece standing.  When the new tiles run out, just keep going without drawing tiles.<br/><br/>Belongs to a series / trilogy, containing:<br/><br/>    Bernini Mysterie<br/>    Da Vinci Code<br/>    Salomon''s Dilemma<br/><br/><br/>', 2002, 2, 4, 8, 15, 15, 15, 1.4945, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (61, 10372, 0, 'diamant', 'The mystic board is in itself enticing. Almost hand-wide in height with ponderous bulges, in magical midnight- blue with glittering diamonds. The game is to light up the individual diamonds with invisible beam. This is done by clever placing of the silver colored stones on the board thus directing the invisible beam onto the right diamonds.<br/><br/>', 1975, 2, 4, 8, 30, 30, 30, 1.5, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (62, 1, 0, 'die-macher', 'Die Macher is a game about seven sequential political races in different regions of Germany. Players are in charge of national political parties, and must manage limited resources to help their party to victory. The winning party will have the most victory points after all the regional elections. There are four different ways of scoring victory points. First, each regional election can supply one to eighty victory points, depending on the size of the region and how well your party does in it. Second, if a party wins a regional election and has some media influence in the region, then the party will receive some media-control victory points. Third, each party has a national party membership which will grow as the game progresses and this will supply a fair number of victory points. Lastly, parties score some victory points if their party platform matches the national opinions at the end of the game.<br/><br/>The 1986 edition featured four parties from the old West Germany and supported 3-4 players. The 1997 edition supports up to five players in the re-united Germany and updated several features of the rules as well.  The 2006 edition also supports up to five players and adds a shorter five-round variant and additional rules updates by the original designer.<br/><br/>', 1986, 3, 5, 14, 240, 240, 240, 4.3145, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (63, 5737, 0, 'domaine', 'The king shall return... But before he does, the realm falls into anarchy and chaos. The lords of the kingdom struggle to improve their place and standing. New borders are drawn, and expanded through strength of arms and subtle maneuver. Each duke seeks to establish a claim over the most valuable parts of the kingdom before the king finally returns. In the dark of the Middle Ages, control of the land was the key to wealth and power. Can you control enough territory to become the most prestigious duke before the king&rsquo;s return?<br/><br/>In Domaine, players form domaines by placing walls on the modular board to enclose territory. Completed domaines can then be expanded, even into your opponents''. Protect domaines by placing knights, which resist expansion.<br/><br/>Actions are taken by playing cards that have a cost associated with them. Gain money by selling cards and controlling mines. Sold cards can be acquired by other players.<br/><br/>Players score points based on the quantity and type of terrain enclosed in their domaines, as well as by controlling many mines of a single type. The winner is the first player to cross a specific point threshold or the player with the most points when the card deck runs out.<br/><br/>', 2003, 2, 4, 12, 60, 60, 60, 2.7113, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (64, 40834, 0, 'dominion-intrigue', 'In Dominion: Intrigue (as with Dominion), each player starts with an identical, very small deck of cards. In the center of the table is a selection of other cards the players can &quot;buy&quot; as they can afford them. Through their selection of cards to buy, and how they play their hands as they draw them, the players construct their deck on the fly, striving for the most efficient path to the precious victory points by game end.<br/><br/>From the back of the box: &quot;Something&rsquo;s afoot. The steward smiles at you like he has a secret, or like he thinks you have a secret, or like you think he thinks you have a secret. There are secret plots brewing, you&rsquo;re sure of it. At the very least, there are yours. A passing servant murmurs, &ldquo;The eggs are on the plate.&rdquo; You frantically search your codebook for the translation before realizing he means that breakfast is ready. Excellent. Everything is going according to plan.&quot;<br/><br/>Dominion: Intrigue adds rules for playing with up to 8 players at two tables or for playing a single game with up to 6 players when combined with Dominion. This game adds 25 new Kingdom cards and a complete set of Treasure and Victory cards. The game can be played alone by players experienced in Dominion or with the basic game of Dominion.<br/><br/>Part of the Dominion series.<br/><br/>Integrates with:<br/><br/>    Dominion<br/><br/><br/>Also released as an expansion that requires the base game or card set to play: Dominion: Die Intrige  Erweiterung.<br/><br/>', 2009, 2, 6, 13, 30, 30, 30, 2.4143, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (65, 2394, 0, 'dominoes', 'A traditional tile game played in many different cultures around the world.  This entry is for Western Dominoes; the standard set being the 28 &quot;Double Six&quot; tiles.  Chinese Dominoes use a 32 tile set with different distributions.<br/><br/>Dominoes is a family of games using the &quot;Western&quot; style tiles.  The standard set of tiles is based on the 21 different combinations made with a roll of two six-sided dice.  Seven (7) additional &quot;Blank&quot; combination tiles combine with the 21 to form the standard 28 &quot;Double-Six&quot; set. &quot;Double-Nine&quot; (with 55 tiles) and &quot;Double-Twelve&quot; (with 91 tiles) are also popular. &quot;Double-Fifteen&quot; sets with 136 tiles also exist.<br/><br/>There are many different games played with Dominoes.  The standard game is known as the Block game.  Forms of this game are known in many different areas of the world with similar rules.  Puerto Rican Dominoes, Latin Dominoes, and Cuban Dominoes are all forms of the Block game.<br/><br/>Another main variety of Dominoes games are based on the &quot;Fives Family&quot;.  Five-up, All Fives, Sniff, and Muggins are all part of this family.  This variation adds the ends of the dominoes to make a multiple of five for scoring.<br/><br/>Other popular Dominoes games include 42, ChickenFoot, and Mexican Train.<br/><br/>', 1500, 2, 10, 5, 30, 30, 30, 1.3711, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (66, 8207, 0, 'dungeoneer-vault-of-the-fiends', 'Dungeoneer: Vault of the Fiends is a non-collectable dungeon-crawl card game for 2-4 players.<br/><br/>It is meant as an expansion to the Dungeoneer: Tomb of the Lich Lord also published by Atlas Games, but Tomb of the Lich Lord is not necessary to play this set, as Vault of the Fiends is also a stand-alone set.<br/><br/>Players play the part of one of six heroes.  Each hero has variable melee, magic and speed scores, as well as a unique ability. Your second role in the game is as the malevolent &ldquo;Dungeonlord&rdquo;, trying to exterminate the other heroes.<br/><br/>You win the game when as a hero you complete 3 Quests such as destroying an evil laboratory or rescuing a princess. An alternate win goal is as the Dungeonlord if all the other heroes are defeated except yours.<br/><br/>Vault of the Fiends features a variety of new heroes.  Elf Assassin, Human Beastmaster, Drakan Sentinal, Ork Shaman, Dwarf Runecaster, and Gnome Illusionist.<br/><br/>Each turn you may:<br/><br/>     Play monsters, traps and other bad events on opponents<br/>     Build a dungeon<br/>     Move around the dungeon with your hero (collect Glory and Peril resources)<br/>     Play abilities and treasures for yourself<br/>     Complete a Quest<br/>     Discard an unwanted card<br/>     Fill your hand to 5 cards<br/><br/><br/>This game is similar to Wiz-War where you race in a dungeon to complete your objectives.  This dungeon is created by the laying down of Map cards. You collect Glory and Peril as you move through the dungeon.  Glory buys cards that help your hero such as abilities and treasures, but your opponent spends your Peril against you to play monsters, traps and other unpleasant stuff.<br/><br/>Combat is similar to Talisman. Roll a six-sided die and add the score you are combating with, either Melee or Magic, to beat your opponent&rsquo;s roll.<br/><br/>The way the cards interact will be familiar to CCG players, in that you have &ldquo;Permanents&rdquo; and &ldquo;Instants&rdquo; that you can use strategically, or in combinations, but this game is not really a strategy game.  Most of the fun comes from the theme, and surprising combination of events that occur.  Dungeoneer is likely to appeal to those who enjoy a classic dungeon crawl and RPG like action.<br/><br/>Vault of the Fiends features a few new mechanics that should serve to enhance the game play which players of Tomb of the Lich Lord will be familiar with.  Some monsters, and attack cards are &ldquo;pumpable&rdquo; that means you may spend extra Glory or Peril to boost the effectiveness of the card.  Also conditions on the map change such as effects being deactivated when a certain Quest is completed or throwing a switch in a room to extend a bridge across the Fiery Chasm.  One of the more unexpected new mechanics are &ldquo;artifact&rdquo; Quests, such as the Armor Golem&rsquo;s Glove which makes your hero more powerful or the Sunken Treasure which makes your hero faster.  These do not confer a level, but are rotated 180 degrees so you can read the bonus they provide.<br/><br/>Part of the Dungeoneer Series.<br/><br/>', 2003, 2, 4, 12, 30, 30, 30, 2.2376, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (67, 148203, 0, 'dutch-blitz', 'In Dutch Blitz, each player has her own deck of forty cards, with cards 1-10 in four colors; red and blue cards show a Pennsylvania Dutch boy, while yellow and green cards show a Pennsylvania Dutch girl. Each deck has a different symbol on the back to aid with card sorting between rounds.<br/><br/>At the start of each round, each player lays out three cards face up in front of her to create her post piles; places a face-up stack of ten cards, seeing only the top card, next to her post piles to create her blitz pile ; and holds the remaining cards in hand face down.<br/><br/>Playing at the same time, each player tries to empty her blitz pile. If she has a 1 on the top of any face-up stack, she plays it to the center of the table to create a Dutch pile. If she has a 2 of the same color as any 1 on top of a Dutch pile, she can place the 2 on the 1. All cards on a Dutch pile must be played in ascending order and must be the same color. A player can also play from the blitz pile onto a post pile, or from one post pile onto another, but only if the numbers are in descending order and the boys and girls alternate.<br/><br/>If a player can''t play anything, she can reveal cards from the stack in her hand, counting them out in groups of three, then laying them face up while revealing only the top card. She can play this top card onto a Dutch pile or post pile as long as she meets the rules for doing so.<br/><br/>As soon as a player empties her blitz pile, the round ends. Each player scores 1 point for each of her cards among the Dutch piles, then loses 2 points for each card remaining in her blitz pile. Players then sort all the cards and play another round. As soon as at least one player has at least 75 points, the game ends and the player with the most points wins.<br/><br/>Note that while the Dutch Blitz: Expansion Pack allows for play of Dutch Blitz with up to eight players (by having differently colored card backs), it is also a standalone game and is therefore listed as a separate edition of Dutch Blitz despite the name.<br/><br/>', 1960, 2, 4, 8, 15, 1, 15, 1.2523, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (68, 1379, 0, 'ebbe-flut', 'Who stops the water?<br/>Tides - the interplay of ebb and flow.<br/>Each player rules one of the tides and tries to use it profitably.<br/>But which is stronger? Does the land have the strength to defy the water, or does the final tide carry the day?<br/><br/>&mdash;description from the publisher (translated)<br/><br/>In this card game players build up cascades of moving cards across the playfield in order to get their cards to reach the final destination in the opposite corner.<br/><br/>', 2000, 1, 2, 10, 45, 30, 45, 1.8913, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (69, 178937, 0, 'el-capitan', 'In El Capitan, players have a series of pictures in front of them and are trying to memorize their locations. These pictures are then flipped face down. During each turn, a card is revealed from the draw pile: players have to place their  boats as quickly as possible on the corresponding card in front of them! Be one of the quickest players to make sure you get some gold. But be careful, as the old Captain has a few tricks up his sleeves which will test your reaction time. Only the richest pirate at the end of the game will be worthy of his ship and title!<br/><br/>', 2015, 2, 6, 6, 20, 20, 20, 1.0, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (70, 19526, 0, 'elasund-the-first-city', 'This is the second game in the ''Abenteuer Catan'' (Catan Adventures) series that started with Candamir: The First Settlers. The theme of Elasund is based on the ''Die Siedler von Catan'' novel written by Rebecca Gabl&eacute;, itself based on the original The Settlers of Catan game. In Elasund, players compete and cooperate to build the premier city of Catan.<br/><br/>', 2005, 2, 4, 10, 90, 60, 90, 2.7301, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (71, 168, 0, 'empire-builder', 'Epic Railroad Building in North America<br/><br/>Discover a modern North American classic.  Celebrate one of our most vital and enduring passions: railroads.  Use your initial investment to build track.  Then pick up commodities where they are grown, mined, or manufactured and deliver them to a lucrative place of demand.  Complete a delivery and make the money you need to buy larger, faster trains, and expand your railroad empire.  Win the game by building the most effective railroad empire!<br/><br/>The original and flagship of Mayfair''s crayon-rails line allows players, using washable crayons, to draw their train routes over a map of North America.  Players start with an initial sum of money which they use to build short lengths of track during their first couple of turns.  For the rest of the game, players operate their trains over the track network drawn on the board to pick up and deliver loads to various cities, and then have the opportunity to add to their track network or improve their train.  The game uses demand cards which list three demands, each of a commodity to be delivered to a specified city for a given payoff.  Each player has three demand cards to provide opportunities for income.<br/><br/>Each turn consists of an operations phase and a building phase.  During the operations phase, trains are moved to cities where commodities are picked up at no cost and moved to one of the cities on that player''s demand cards.  When the commodity is delivered, the player receives the payoff and trades that demand card for a new one.  Event cards are mixed in the deck with the demand cards.  When an event card is drawn the instructions are followed.  During the building phase a player may pay to build more track or upgrade his train.<br/><br/>A player wins by being the first to connect his track network to six of the seven major cities on the board and acquire $250,000,000 in cash on hand.<br/><br/>', 1982, 2, 6, 12, 180, 180, 180, 2.6305, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (72, 199792, 0, 'everdell', 'Within the charming valley of Everdell, beneath the boughs of towering trees, among meandering streams and mossy hollows, a civilization of forest critters is thriving and expanding. From Everfrost to Bellsong, many a year have come and gone, but the time has come for new territories to be settled and new cities established. You will be the leader of a group of critters intent on just such a task. There are buildings to construct, lively characters to meet, events to host&mdash;you have a busy year ahead of yourself. Will the sun shine brightest on your city before the winter moon rises?<br/><br/>Everdell is a game of dynamic tableau building and worker placement.<br/><br/>On their turn a player can take one of three actions:<br/><br/>a) Place a Worker: Each player has a collection of Worker pieces. These are placed on the board locations, events, and on Destination cards. Workers perform various actions to further the development of a player''s tableau: gathering resources, drawing cards, and taking other special actions.<br/><br/>b) Play a Card: Each player is building and populating a city; a tableau of up to 15 Construction and Critter cards. There are five types of cards: Travelers, Production, Destination, Governance, and Prosperity. Cards generate resources (twigs, resin, pebbles, and berries), grant abilities, and ultimately score points. The interactions of the cards reveal numerous strategies and a near infinite variety of working cities.<br/><br/>c) Prepare for the next Season: Workers are returned to the players supply and new workers are added. The game is played from Winter through to the onset of the following winter, at which point the player with the city with the most points wins.<br/><br/>', 2018, 1, 4, 13, 80, 40, 80, 2.812, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (73, 258, 0, 'fluxx', 'Fluxx is a card game in which the cards themselves determine the current rules of the game. By playing cards, you change numerous aspects of the game: how to draw cards, how to play cards, and even how to win.<br/><br/>At the start of the game, each player holds three cards and on a turn a player draws one card, then plays one card. By playing cards, you can put new rules into play that change numerous aspects of the game: how many cards to draw or play, how many cards you can hold in hand or keep on the table in front of you, and (most importantly) how to win the game. There are many editions, themed siblings, and promo cards available.<br/><br/>', 1997, 2, 6, 8, 30, 5, 30, 1.3892, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (74, 17157, 0, 'forbidden', 'From the publisher''s website:<br/><br/>Mah Jongg meets Gin Rummy! Themed with Chinese zodiac imagery, this fast paced, set-making card game finds players battling to accumulate 200 points over several rounds of play! Use your Forbidden cards to stop your opponents or multiply your score. Watch out! If you''re caught with them in your hand at the end of the round, you lose points. In Forbidden, the best cards are the most dangerous!<br/><br/>', 2004, 2, 4, 10, 35, 35, 35, 1.4167, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (75, 173, 0, 'formula-de', 'Formula D&eacute; is a fast-paced racing game in which the cars'' top speeds are limited by having to end a certain number of turns in each curve of the racetrack.  This can be tricky, because although players can regulate their speeds by choosing which gear to be in and each gear allows a certain range of movement, the exact amount is determined randomly.   Great fun for a big group.<br/><br/>A winner of the 1990 Concours International de Crateurs de Jeux de Socit.<br/><br/>Expanded by: (Ludodlire Expansions)<br/><br/>    Formule D Circuit  1: Grand Prix de MONACO  (included in french edition)<br/>    Formule D Circuit  2: FRANCE  Circuit de Nevers Magny-Cours<br/>    Formule D Circuit  3: GRAN PREMO D''ITALIA  Autodromo Nazionale Monza<br/>    Formule D Circuit  4: GROSSER PREIS VON DEUTSCHLAND  Hockenheim Ring  (included in german edition)<br/>    Formule D Circuit  5: GRAND PRIX DE BELGIQUE  Circuit de Spa  Francorchamps<br/>    Formule D Circuit  6: GRANDE PREMIO DE PORTUGAL  Circuito do Estoril<br/>    Formule D Circuit  7: BRITISH GRAND PRIX  Silverstone Circuit  (included in british edition)<br/>    Formule D Circuit  8: GRAN PREMIO DE ESPAA  Circuit de Catalunya<br/>    Formule D Circuit 	 9: GRAND PRIX DU CANADA  Circuit Gilles Villeneuve<br/>    Formule D Circuit 	 10: GRANDE PREMIO DE BRASIL  Circuito do Interlagos<br/>    Formule D Circuit  11: JAPAN GRAND PRIX  Suzuka Circuit<br/>    Formule D Circuit  12: SOUTH of AFRICA GRAND PRIX  Kyalami Circuit<br/>    Formule D Circuit  13: SAN MARINO  Autodromo Enzo & Dino Ferrari<br/>    Formule D: World Championship<br/><br/><br/>Expanded by: (Descartes Editeur Expansions)<br/><br/>    Formula D Circuits 1 & 2: Monaco & Zandvoort 1   (plans were included in base game)<br/>    Formula D Circuits 3 & 4: Zandvoort 2 & SPA-Francorchamps<br/>    Formula D Circuits 5 & 6: Kyalami & Ferrari Autodromo<br/>    Formula D Circuits 7 & 8: Magny-Cours & Monza<br/>    Formula D Circuits 9 & 10: Estoril & Interlagos<br/>    Formula D Circuits 11 & 12: Watkins Glen & Silverstone<br/>    Formula D Circuits 13 & 14: Montreal & Long Beach<br/>    Formula D Circuits 15 & 16: Hockenheim & Zeltweg<br/>    Formula D Circuits 17 & 18: Buenos-Aires & Barcelona<br/>    Formula D Circuits 19 & 20: Suzuka & Melbourne<br/>    Formula D Circuits 21 & 22: Budapest & Nrburgring<br/>    Formula D Circuits 23 - 26: USA Track Pack #1<br/>    Formula D Circuits 27 - 30: USA Track Pack #2<br/>    Formula D Circuits 31 & 32: Zhuhai & Sepang<br/>    Formula D Circuit 33: 10th Anniversary<br/>    Formula D Circuits 34 & 35: Bahrain & Shanghai<br/><br/><br/>Expanded by: (Asmodee Expansions)<br/><br/>    Formula D: The "Shortcut"<br/>    Formula D: Circuits 1  Sebring & Chicago<br/>    Formula D: Circuits 2  Hockenheim and Valencia<br/>    Formula D: Circuits 3  Singapore & The Docks<br/>    Formula D: Circuits 4  Grand Prix of Baltimore & Buddh<br/>    Formula D: Circuits 5  New Jersey & Sotchi<br/>    Formula D: Circuits 6  Austin & Nevada Ride<br/><br/><br/>Re-implemented by:<br/><br/>    Formula D Mini<br/>    Formula D<br/><br/><br/>', 1997, 2, 10, 10, 120, 120, 120, 1.9591, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (76, 9216, 0, 'goa-a-new-expedition', 'Goa, a strategy game of auctions and resource management, is set at the start of the 16th century: beautiful beaches, a mild climate, and one of the most important trading centers in the world. Competing companies deal in spices, send ships and colonists into the world, and invest money. Are you on top or at the bottom? It depends on how you invest your profits. Will you make your ships more efficient? Enhance your plantations? Recruit more colonists? Only a steady hand in business will help.<br/><br/>Each turn begins with an auction phase, where each player gets to auction one item (and the starting player two items). The first item being auctioned gives the right to go first the next turn (along with a card that gives an extra action). If you buy your own item, you pay it to the bank. If someone else buys the item you sell, they pay you. Items include plantations complete with crops, income tiles (income in money, ships, plantation refills each turn etc.), ships, settlers, and later on tiles that score points for certain achievements.<br/><br/>After the auction, players get three actions to either improve their technologies or produce things such as spices on plantations, ships, money or build more plantations. Each player has a board showing their advancement for various things: getting ships, planting new spices, getting colonists, etc. The more a player advances along one track, the better one is doing that particular action. The further you get along a certain track, the more points that track is worth at the end, and there are also rewards to the first player who reaches the last two levels along each track. On the other hand, each player normally needs to perform the actions for all the tracks at some point, so it''s not necessarily a good idea to concentrate on just a couple of them. Goa is a game that gives plenty of opportunity for tough decisions, since a player always has at least one action too few.<br/><br/>The game mixes an interactive element of the auction, which encourages you to nominate things that other players want so you receive cash with the solitaire management of your plantation, which then interacts later on as players race to be first in the top tech levels.<br/><br/>The 2012 edition of Goa includes four new tiles and a new play variant, as noted on the cover of the Z-Man Games edition.<br/><br/>', 2004, 2, 4, 12, 90, 90, 90, 3.3717, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (77, 3139, 0, 'goldland', 'Each player has a backpack with room for 12 tools, provisions, trading goods, or treasures.  The number of squares you can move on a turn is the number of empty spaces in your backpack, so the lighter you travel, the faster.<br/><br/>In the beginning, only 13 tiles (two legs of a 7x7 square) are on the table, and everybody starts in the corner with three fish (provisions) and two pearl necklaces (trading goods).  One thing to do on your turn is &quot;explore,&quot; adding a randomly drawn tile next to the one where your pawn currently stands.  The board gradually fills in to the point where the tile at the opposite corner from the start is drawn, and this tile is designated the site of the lost temple and pays bonuses for everyone who reaches it.  The sooner you get there, the better the bonuses.<br/><br/>About half the squares are free to enter and let you obtain other items for your backpack.  If you''re already carrying a fishing pole, for example, in some squares you''ll be able to pick up more fish.  The other half are &quot;adventure&quot; tiles that require the expenditure of backpack items in order to gain entry.  You might have to spend two rifles, for example, to enter a wildcat tile; then you place a &quot;camp&quot; marker and can enter that tile for free in the future.  A lot of the game involves going back and forth to tiles where you can assemble the necessary items to work your way through the adventure tiles to the lost temple.<br/><br/>Goldland appeals to puzzle-solvers and has a fun atmosphere of exploring the wilderness in search of El Dorado.<br/><br/>', 2002, 2, 5, 10, 80, 60, 80, 2.3897, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (78, 2472, 0, 'grave-robbers-from-outer-space', 'A fast-paced, humorous look at B-rated science-fiction movies. Players create bad horror and sci-fi films using cards that represent characters, props, locations, creatures and special effects. Creatures are used to attack characters. Props and locations can strengthen characters against creatures. Whoever has the strongest characters in play when the credits roll wins the game.<br/><br/>Part of the B-Movie Series of card games.<br/><br/>', 2001, 2, 6, 13, 40, 20, 40, 1.4878, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (79, 116, 0, 'guillotine', 'The French Revolution is famous in part for the use of the guillotine to put nobles to death, and this is the macabre subject of this light card game.  As executioners pandering to the masses, the players are trying to behead the most popular nobles.  Each day the nobles are lined up and players take turns killing the ones at the front of the line until all the nobles are gone.  However, players are given cards which will manipulate the line order right before ''harvesting'' heads, which is what makes the game interesting.  After three days of chopping, the highest total carries the day.<br/><br/>', 1998, 2, 5, 12, 30, 30, 30, 1.2666, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (80, 8989, 0, 'hansa', 'Players are merchants of the Hanseatic League. Players take control of the ship and buy and sell goods, establish trading posts, and sail to find new markets. The board is a very simple map of Scandinavia, with arrows from point to point restricting where the boat is able to move. The active player takes control of the boat and must pay to move to each new city where he may either buy, sell, or expand. Players want sets of goods that they can trade for victory points, but also need to expand their market presence to generate revenue.<br/><br/>', 2004, 2, 4, 10, 60, 60, 60, 2.3365, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (81, 43015, 0, 'hansa-teutonica', 'The players act as traders trying to get victory points for building a network of offices, controlling cities, collecting bonus markers, or when other traders use the cities they control. After controlling a line between two cities with your pawns, you can decide to build an office (and maybe also establish control and/or get a bonus marker) or to get a skill improvement from some of the cities.<br/><br/>Players have to improve their traders'' &quot;skills&quot; for the following effects: getting more VP from offices in their network, getting more available action points, increasing the number of available pawns, and getting the right to place pawns and get more special pawns.<br/><br/>This game appeared originally as Wettstreit der H&auml;ndler at the Hippodice competition.<br/><br/>', 2009, 2, 5, 12, 90, 45, 90, 3.0951, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (82, 3318, 0, 'heave-ho', 'Two Scottish players participate in a classic tug-of-war, joined on occasion by Nessie.  Players first scramble to build their decks in real time.  After the decks have been built, card play goes back and forth until someone pulls the whisky barrel across their line and claims it. First one to win three whisky barrels wins the game.<br/><br/>Heave Ho! is part of the Kosmos two-player series.<br/><br/>', 2002, 2, 2, 10, 45, 45, 45, 1.2841, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (83, 8203, 0, 'hey-thats-my-fish', 'In Hey, That''s My Fish!, players want to catch as many fish as possible with their waddle of penguins. Each turn, a player moves one penguin in a straight line over hex-shaped ice tiles with 1, 2 or 3 fish on them. The player then collects the hex from where the penguin started its movement from the table, thereby creating a gap which penguins can''t cross on future turns. When a penguin can''t move, it''s removed from play with its owner claiming the tile on which it stands. The player who collects the most fish wins.<br/><br/>', 2003, 2, 4, 8, 20, 20, 20, 1.4488, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (84, 913, 0, 'high-bohn', 'High Bohn is the first of the Bohnanza expansions printed by Lookout Games. It was released in a limited run, then was slightly reworked and published by AMIGO as High Bohn: Bohnenduell um 12 Uhr mittags and then by Rio Grande Games as High Bohn Plus.<br/><br/>There is a building type for each bean in the original game. Each building type gives the player some special ability to help trading, planting beans, or harvesting. The value of each building a player builds is added to his score at the end of the game and bonus points are awarded for completing different types of buildings.<br/><br/>', 2000, 3, 5, 12, 45, 45, 45, 1.8214, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (85, 7667, 0, 'historys-mysteries-card-game', 'From the box:<br/><br/>Explore the more unusual side of history with the History''s Mysteries Card Game. This 90-card deck features ten of the most well-known, yet unsolved, mysteries. Instructions for a rummy-like card game focus on making melds (three or more of a kind) and playing your cards as Fact or Fiction. Players try to outwit one another by deciding whether or not to challenge or support a mystery as it is played on the table. The majority rules at the end of the game and the player to reach 100 points or more first is the winner. Decide for yourself-is it Fact or Fiction?<br/><br/>While not officially included, History''s Mysteries Card Game is often considered part of the Mystery Rummy series.<br/><br/>', 2003, 2, 6, 10, 45, 45, 45, 1.3, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (86, 8552, 0, 'i-go', 'In I Go!, players draw and discard iteratively, attempting to improve the quality of their hands. You can improve your hand by forming a run (using 1 or 2 colors), matching the top card of the ''display'' stack, or simply keeping low values cards. After your turn, you can declare &quot;I Go!&quot; to claim that you have the best hand (fewest penalty points). Other players can then play off of your run, and the best hand scores a point. First to 4 points wins.<br/><br/>The deck contains 10 suits, each numbered 1-11, for a total of 110 cards. The game is abstract and has no theme.<br/><br/>From the box:<br/>I Go! is a fast-paced game that gets the whole family thinking on their feet. Draw cards in turns and try to improve your hand. Think yours in the best? Declare &quot;I Go!&quot; Were you too hasty, or was it worth taking the risk? Be alert and astute and win at I Go!<br/><br/>Corsari is the original release of the game with a Pirate theme.<br/><br/>', 2003, 2, 4, 8, 30, 30, 30, 1.4789, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (87, 130, 0, 'iron-dragon', 'Description from the publisher:<br/><br/>Iron Dragon takes railroading games where they have never gone before &mdash; to a land filled with elves, cat-people, trolls and magic. Genetically engineered dragons pull trains across dangerous and unexplored territory. Connect cities, fight off forest creatures, and explore the underground to build a railroad empire.<br/><br/>Based on the Empire Builder system, this fantasy game puts classic building strategy and money management tools in a new venue. Players use erasable crayons on a special board and operate a rail empire. Perfect for an evening of fun and adventure with family and friends.<br/><br/>In Iron Dragon, probably the most elaborate of the crayon rail games from Mayfair Games, players are set within a fantasy world attempting to create an extensive and profitable rail network.  Players use crayons to draw their rail lines on the game board itself and use their existing rail lines to pick up and deliver commodities for payouts dictated by cards.<br/><br/>In addition to the standard mechanisms of Empire Builder, Iron Dragon introduces Foremen, which reduce terrain building/river crossing costs depending on their race (elves get a discount in the forest, dwarves get a discount in the mountains, etc.) and Ships, which allow trains to cross the sea between continents, avoid bottlenecks on land, or jump between two unconnected rail networks. Resources are much more segregated by region, with each region specializing in a few resources based on their back story (which is written in the manual).<br/><br/>', 1994, 2, 6, 12, 240, 240, 240, 2.9329, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (88, 176494, 0, 'isle-of-skye-from-chieftain-to-king', 'Isle of Skye is one of the most beautiful places in the world, with soft sand beaches, gently sloping hills, and impressive  mountains. The landscape of Isle of Skye is breathtaking and fascinates everyone.<br/><br/>In the tile-laying game Isle of Skye: From Chieftain to King, 2&ndash;5 players are chieftains of famous clans and want to build their kingdoms to score as many points as possible&mdash;but in each game only four of the sixteen scoring tiles will be scored.<br/><br/>Thanks to the scoring tiles, each game is different and leads to different tactics and strategies, but having enough money is useful no matter what else is going on. Managing that money can be tricky, though. Each turn, each player places two area tiles in front of them and sets the selling price for the tiles. Setting a high price is great, but only so long as someone actually pays the price because if no one opts to buy, then the seller must buy the tiles at the price they previously requested.<br/><br/>In the end, the player with the best kingdom&mdash;and not the richest player&mdash;becomes the sovereign of the island.<br/><br/>', 2015, 2, 5, 8, 50, 30, 50, 2.2538, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (89, 183251, 0, 'karuba', 'This is a tile-laying race game with players starting with boards that are identical, and one player drawing tiles that they all will use. They race to get their explorers to temples first and earn points. Along the way they can collect additional points by collecting items off the paths they create. The game ends when one player gets all of their explorers to their corresponding temples or whenever the last tile is drawn and placed. Most points wins.<br/><br/>Description from the English Ruleset:<br/><br/>Many moons have come and gone since your boats departed on the journey to Karuba. Once you arrive on the island, each player will lead an expedition team of four adventurers. Now you just have to navigate your way through the dense jungle to make it to the temples. &bdquo;Just&ldquo; may be something of an understatement; the ancient jungle trails have to be found and uncovered first! Hurry up and be the first to reach the temples to collect the most valuable treasures. Many paths have dead ends and you need to be patient to find the right/best way (through the jungle). Look! A gold nugget! You can pick it up and collect it, same applies to the shiny crystals along the paths.<br/><br/>', 2015, 2, 4, 8, 40, 30, 40, 1.431, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (90, 25674, 0, 'khronos', 'In this game, you play a powerful lord and his faithful companion engaged in a fight for influence throughout time. The game proceeds simultaneously over three different periods. You start the game in the Middle Ages, on the first of the three game boards (that of the commanderies). With 4 action cards in hand per turn, you have seven turns in which to develop your domains by building various types of military, religious, and civil buildings. Depending on their size, certain buildings are moved in time, which means that they are transferred to the same place on the priories board (Renaissance period) and on the brotherhoods board (modern period), in ruins for military and religious buildings (castles, abbeys&hellip;).<br/><br/>Thanks to the watch makers'' invention, and with enough money, you can make your two adventurer pawns travel in time&hellip; Because if the construction of certain buildings can be profitable, taking over domains on the various boards is essential, since it will allow you to earn bonuses on the 4th and 7th turns and to move ahead of your opponents.<br/><br/>Playing with time is not without consequences, and it can produce surprising results! To give just one example, an abbey created on the priories board could be destroyed by a castle built later in the game in the same place but on the commanderies board, and then moved to the other board&hellip; The abbey finally never existed!<br/><br/>On the 4th and 7th turns, each controlled domain generates profits for the players depending on the board. On the the commanderies board, a player who controls a domain militarily, i.e. the one with the biggest military building, will receive the value of the civil buildings in this domain in profits. On the priories board, it is the religious control that will be taken into account. On the brotherhoods board, the players who have best populated the civil buildings and restored the ruins will secure the best profits.<br/><br/>The possibility of destroying and regrouping buildings to unite or divide domains provides a strong and permanent level of interaction between the players.<br/><br/>', 2006, 2, 5, 10, 90, 90, 90, 3.5596, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (91, 6263, 0, 'kings-breakfast', 'The king has invited you to his castle for breakfast.  During the feast the players will take portions of various dishes from the table to eat.  As a good host, the king will serve all his guests before taking any portion from each course.  From time to time, his pet dragon Emerald will steal some food from his master.  Of course, it is rude for a player to have more of a dish than the king, so players must be careful not to be too greedy.  In the end, the winner is the player who gets the most to eat of the things the king likes best without eating more than the king eats of any dish.<br/><br/>Online Play<br/><br/><br/>     BrettspielWelt (real-time)<br/><br/><br/>', 2003, 3, 5, 7, 15, 15, 15, 1.1781, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (92, 204583, 0, 'kingdomino', 'In Kingdomino, you are a lord seeking new lands in which to expand your kingdom. You must explore all the lands, including wheat fields, lakes, and mountains, in order to spot the best plots, while competing with other lords to acquire them first.<br/><br/>The game uses tiles with two sections, similar to Dominoes. Each turn, each player will select a new domino to connect to their existing kingdom, making sure at least one of its sides connects to a matching terrain type already in play. The order of who picks first depends on which tile was previously chosen, with better tiles forcing players to pick later in the next round. The game ends when each player has completed a 5x5 grid (or failed to do so), and points are counted based on number of connecting tiles and valuable crown symbols.<br/><br/>', 2016, 2, 4, 8, 25, 15, 25, 1.22, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (93, 1449, 0, 'kings-cribbage', 'Take Cribbage and Scrabble, shake well, and you will have Kings Cribbage.  The tiles correspond to a standard deck of cards except that there are only two suits (dark brown and light brown). You place the tiles on the board a la Scrabble and try to form the highest Cribbage hand possible.  All tiles that are placed must score.  Scores are as standard Cribbage for the most part and as in Scrabble you may score in multiple rows and or columns at the same time.  No more than 5 tiles may be placed consecutively.<br/><br/>', 1997, 2, 4, 12, 30, 30, 30, 1.8519, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (94, 329829, 0, 'loco', 'The Game of Loco is one of a trio of games from Chad Valley''s Kompactum Edition, circa 1910.<br/><br/>A simple roll and move sees players leave one of three railway stations in London and race through the English towns and countryside to finish in Edinburgh. Along the way the players can be hampered or favoured by landing on specific squares. First to reach Edinburgh is the winner.<br/><br/>The Kompactum Edition version of this game probably came boxed with two other Chad Valley games being ''Aerial Derby'' and ''Rescue'' as the board dimension is exactly double that of ''Aerial Derby'' and ''Rescue. The other two games are listed separate.<br/><br/>&mdash;user summary<br/><br/>', 1910, 2, 3, 8, 45, 15, 45, 0.0, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (95, 198525, 0, 'lotus', 'Lotus is a beautiful game that grows into a unique work of art every time you play.<br/><br/>Clear your head and take in the quiet strength of the lotus garden. It takes skillful care and nurturing to grow these flowers to their full potential, but, once picked, they provide their owner with wisdom. Beware, for there are others who will do anything they can to get their hands on these mystical flowers. You''ll need to enlist the help of creatures native to this land to take control of the lotus garden and achieve true enlightenment.<br/><br/>', 2016, 2, 4, 8, 30, 30, 30, 1.46, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (96, 13642, 0, 'louis-xiv', 'Louis XIV, by R&uuml;diger Dorn, is about power and influence in the French court at the end of the 17th Century.<br/><br/>The players take on the roles of members of the Court, where they carry out their missions and goals at Versailles. By using cards and influence markers, they influence high-ranking Court attendants, such as the King''s Mother or one of the countless Royal mistresses. Naturally, the Sun King himself has a special role here too.<br/><br/>An excellent time and a high level of tension are guaranteed. The final outcome is in doubt right up to the end. Each game is different. A change of pace but still a highly promising strategy game in the finest Alea tradition, one that sits at level 5 on the Alea complexity scale.<br/><br/>', 2005, 2, 4, 12, 100, 75, 100, 3.0041, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (97, 63539, 0, 'lupus-in-tabula', 'Werewolves haunt the secluded village known as Tabula: every night some villagers turn into werewolves and slaughter an innocent victim to satisfy their hunger.<br/>Surviving villagers gather every day to discuss the problem: at the end of the discussion, they lynch one person among them, thinking he could be a werewolf.<br/>Can you survive the massacre? Can you solve the mystery of the full moon?<br/><br/>A game for large groups that is already a classic.<br/>To win you need the intuition of a detective... or your best poker face!<br/>The new edition includes:<br/><br/>     Deluxe oversized cards featuring original characters<br/>     Updated high quality game components<br/>     Special Ghost rules that allow everyone to play until the mystery is solved<br/>     A new 8-player moderator-free variant<br/>     And, of course... The Werehamster!<br/><br/><br/>Lupus takes inspiration from Werewolf, introducing several new and original rules, including the possibility to play a third faction other than werewolves and villagers. The box contains the classic cards representing the werewolves, the seer and the villagers, but it also adds some unique characters such as a werehamster and a medium. Players are not eliminated during the game, but keep playing as ''ghosts''.<br/><br/>', 2001, 8, 24, 8, 40, 20, 40, 1.1961, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (98, 872, 0, 'm', 'An abstract strategy game where players attempt to lay tiles such that they border as many other tiles as possible.  Players also collect 2 colors of tiles and avoid the other colors as they will negate your score.<br/><br/>', 2000, 2, 6, 10, 30, 30, 30, 1.9615, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (99, 358690, 0, 'mantis', 'Mantis has only two rules: Steal or Score your way to victory. Collect matching cards by stealing or scoring until the winner has 10 cards in their score pile.<br/><br/>With the simplicity of UNO and depth of Gin Rummy, Mantis is designed for both kids and adults. But adults should be warned that kids will often beat them at this game.<br/><br/>', 2022, 2, 6, 7, 10, 10, 10, 1.0357, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (100, 24762, 0, 'medici-vs-strozzi', 'This game re-lives the fierce competition between the two great Florentine families: Medici and Strozzi. The players compete to buy the best goods, load them on their ships, and sail away to sell them for great profits. The mechanism is similar to Medici, but for two players.<br/><br/>One of the Knizia Florentine auction games.<br/><br/>', 2006, 2, 2, 10, 30, 30, 30, 2.4518, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (101, 2955, 0, 'mexica', 'Mexica plots the development of the city of Tenochtitlan on an island in Lake Texcoco. Players attempt to partition it into districts, place buildings, and construct canals.<br/><br/>Districts are formed by completely surrounding areas of the island with water and then placing a District marker. The player who founds a district scores points immediately.<br/><br/>Canals and Lake Texcoco act as a quick method of moving throughout the city. Players erect bridges and move from one bridge to the next, which costs 1 action point regardless of the distance. They must also erect buildings. This costs action points, the exact number being dependent upon the building''s size.<br/><br/>In the scoring phases of the game, players score points (El Grande style) based upon their dominance in a District. In the 4 player game, players with the 1st, 2nd, and 3rd most buildings score decreasing numbers of points.<br/><br/>Only districts are scored in the first scoring round.<br/><br/>In the second scoring round at the end of the game, all land areas are scored, not just districts.<br/><br/>The player with the most points wins.<br/><br/>Mexica is the third game in the Mask Trilogy.<br/><br/>', 2002, 2, 4, 10, 90, 90, 90, 2.6881, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (102, 11634, 0, 'mexican-train', 'Mexican Train is a fairly recently developed variation of Domino train type games that has become extremely popular.  Because of its simplicity and interaction,  it can be played by nearly anyone, anywhere.  Depending on the type of game you play, it can last from a single, 20-minute game to a 12 round game lasting hours.<br/><br/>Although Mexican Train can be played with a standard set of Dominos, branded versions usually include a range of parts to facilitate play and highlight the theme, such as a train station, train pieces to mark players'' trains and the &quot;Mexican train&quot;, and a &quot;woo woo!&quot; train whistle.  It is typically played with a set of double 12 dominoes (although double 6 and double 9 sets can be used with fewer players), and there are a variety of sets packaged by various manufactures as &quot;Mexican Train Dominoes&quot; that include all the necessary components to play.<br/><br/>A double-twelve domino set has 91 tiles. The goal is for the players to get rid of their dominoes. Starting with the highest double tile placed in the middle of the table, which is the station, each player creates a line of dominoes. This is their train. Another train, the &quot;Mexican Train,&quot; can be played on by anyone. In the event that a player cannot play at all, even after drawing a new tile, she must place a marker (often little colored plastic trains that come with the game) on their train which allows others to play on her train temporarily until the marker is removed.<br/><br/>As soon as one player is out of dominoes, the other players add up the value of their remaining tiles. At the end of the evening, the player with the lowest score is the winner.<br/><br/>', 1994, 1, 8, 10, 20, 20, 20, 1.26, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (103, 590, 0, 'mille-bornes', 'One Thousand Milestones. On French roads there were small marker stones giving the distance in kilometres to the next town. In this famous old French card game, players compete to drive 1000 km, dealing with hazards along the way. Draw a card to your hand, play or discard. You must lay a green traffic light to start, play cards showing mileage, dump hazards (flat tire, speed limit) on the other players, remedy hazards (spare tire, end of limit) from yourself, play safety cards (puncture proof), and try to be the first to clock up the distance.<br/><br/>', 1954, 2, 6, 8, 45, 45, 45, 1.2483, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (104, 5942, 0, 'mystery-rummy-al-capone-and-the-chicago-underworld', 'Mystery Rummy: Al Capone and the Chicago Underworld, the fourth title in the Mystery Rummy series, introduces some elements of Canasta with players scoring bonuses for collecting complete sets. Sets have varying numbers of cards in them, from Mike Heitler with four cards up to Al Capone with eight.<br/><br/>The four types of gavel card make cards accessible everywhere: &quot;Agent Meeting&quot; searches other players'' hands, &quot;Eliot Ness&quot; searches the deck, &quot;Search Warrant&quot; looks in the discard pile, and &quot;Raid&quot; allows you to take an opponent''s already melded cards, provided you have at least three melded. All these mechanisms help make completing entire sets for their bonuses something you can reasonably strive for &ndash; while also putting you on guard against your opponent doing the same.<br/><br/>', 2003, 2, 4, 8, 40, 20, 40, 1.587, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (105, 106, 0, 'mystery-rummy-jack-the-ripper', 'This game attaches an interesting theme to a fairly standard Rummy framework.  Playing Victims, Suspects, Scenes, and Evidence-melds, players try to build a case against various suspects for the famous Jack the Ripper serial murders.  Whichever suit has the most cards played in it when a player goes out is the guilty party, but if all the Victim cards come out before the end of the game, the Ripper might escape, giving the player who produced that card a significant point allowance.<br/><br/>This is #1 in the Mystery Rummy series.<br/><br/>', 1998, 2, 4, 10, 45, 45, 45, 1.7483, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (106, 1265, 0, 'mystery-rummy-jekyll-hyde', 'It''s still rummy at heart, with multiple suits of 5 cards each, with the twist being that the suits are designated J for Jekyll, H for Hyde, or J/H for suits that count as both Jekyll and Hyde. The unique mechanism in this version of MR is that there is a two sided card (the ''identity card'') on the table next to the draw deck, which has Jekyll on one side, and Hyde on the other. At the start of the game, Dr. Jekyll is showing, but this can change if a &quot;potion&quot; card is played (one of the three gavel cards, cards you can only play one of on your turn). You then flip the identity card over, and draw 2 cards from the draw deck. This is important, because you can only play melds whose suit matches the identity that is currently showing.<br/><br/>The identity card is important in scoring as well, because any melds that match the identity card when scoring count double, and during scoring if all your meld suits match the current identity card, you shut the other player out! This makes for a tense endgame, especially if you''re trying to go for a shutout, because there is a card ''transformation that can change the value of your or an opponents meld from one suit to another.<br/><br/>Add in one more gavel card type (''work in lab'') which lets you draw three cards from the draw deck and keep one, or the top of the discard pile, but only if the card you take matches the identity currently showing. The round ends when one player goes out, and scoring then occurs. Cards in your hand count as negative points.<br/><br/>This is #3 in the Mystery Rummy series.<br/><br/>', 2001, 2, 2, 10, 45, 45, 45, 1.531, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (107, 371, 0, 'mystery-rummy-murders-in-the-rue-morgue', 'The second Mystery Rummy game.  In this one players investigate the murder from the Edgar Allan Poe story.  The basic mechanics (evidence card melds, gavel cards, etc.) are similar to the first Mystery Rummy game, but this one adds a hidden &quot;kitty&quot; in which players secretly place cards throughout the hand.  The first player to go out (before the draw deck is exhausted) wins the kitty in addition to their regular melds.<br/><br/>Can be played as a partnership game with 4 players.<br/><br/>', 1999, 2, 4, 8, 40, 20, 40, 1.7067, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (108, 4396, 0, 'odins-ravens', 'Each morning, Odin sends the ravens Hugin and Munin to race over the world of Midgard and report back what they have seen. The first to return wins Odin''s favor, but any cunning corvid has a few tricks in store, and these are the two most brilliant birds in Middle Earth.<br/><br/>In this two-player card game Odin''s Ravens, two ravens race across separate tracks, the tracks comprising domino-style landscape cards that feature different types of land. Each player has their own deck of cards, which they use to match the land type in front of their raven in order to advance the raven toward the end of the flight path. Odin (Loki in Osprey Edition) cards allow a player to take special actions, such as rearranging the track of landscape cards or impeding the other player''s raven.<br/><br/>In this first edition of Odin''s Ravens, each player can create a personal auxiliary stack during play, playing cards from the hand now to set up plays in the future. The game lasts multiple rounds, with a round ending when a raven reaches the end of the flight path; that raven''s player scores points equal to the distance separating the two ravens. There is also an Odin token that can slow down whichever raven it is in front of.  In addition, whoever has played more cards to the &quot;Magic Way&quot; during the round &ndash; a separate playing area in which players may play a particular type of card &ndash; wins three points. Once a player has accumulated twelve or more points, that player wins.<br/><br/>The Odin''s Ravens (Second Edition) transforms the game into a single race across a longer landscape, with players drawing a limited number of cards each turn from either the Loki deck or the land deck and playing as many cards as they desire. Whoever reaches the end of the world first wins.<br/><br/>', 2002, 2, 2, 10, 30, 30, 30, 1.6795, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (109, 24773, 0, 'on-the-underground', 'Aim of the game from the rulebook:<br/><br/>The goal of the game is to build the most successful Underground lines and in doing so gain the most points.  You can gain points by connecting your lines to various destinations on the board, and by having the passenger use your lines to travel from station to station.<br/><br/>The player who has best balanced the demands by the time that the deck of destinations is exhausted will be declared the winner.<br/><br/>Gameplay overview:<br/><br/>In On the Underground, the players represent companies building underground lines in London. Each player controls 2-4 different lines (based on the number of players).<br/><br/>On each turn, a player can build four pieces of track on the map in any of their color. All track pieces must extend the color. Alternatively, a player may decide to use two branch tokens (acquired by extending lines to the terminus stations or skipping building turns) to branch out of the line.<br/><br/>During the track building part, the active player can score in four different ways:<br/><br/>     Connect their line to a station with a National Rail symbol (1p)<br/>     Connect their line to a terminus station (2p + a branch token)<br/>     Connect two connection tokens of the same type (3p)<br/>     Building a circular line (1p for each station &quot;inside&quot; the line)<br/><br/><br/>After each turn, the passenger moves to one or two of the four face up destination cards; first to one express destination and then to a regular destination. If there are no cards face up in either type, the passenger only moves once. The passenger always uses the shortest route from their current position, avoiding walking and line changes. The passenger scores one point for each line they used to get to their destination.<br/><br/>When there is not enough destination cards to turn face up from the deck, the passenger marker is removed from the game. Players get equal turns, but after the passenger marker is removed, no more points are awarded from passenger movement and players can only build track. The player with the highest amount of points wins.<br/><br/>', 2006, 2, 5, 7, 60, 60, 60, 2.441, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (110, 2593, 0, 'pass-the-pigs', 'This very portable beer &amp; pretzels game comes as a pocket travel case containing 2 pig dice, two pencils and a scoring booklet that also includes the scoring table. The pigs are actual pig miniatures, with a dot on their right flanks.<br/><br/>The object is to be the first to score 100 points using &quot;pigs&quot; as dice. On your turn, you throw the pigs and hope they end up in a scoring position such as a &quot;snouter,&quot; &quot;trotter,&quot; or &quot;leaning jowler&quot; (ranging in value from 1 to 60 points); if they do, you decide whether to &quot;cash&quot; the points (pass the pigs to the next player) or to roll again. If you roll a non-scorer (&quot;pig out&quot; - one pig on the right flank, the other on the left flank; a fairly frequent result), you lose any as-yet-uncashed points. If you throw an &quot;oinker&quot; (both pigs touching each other), you lose your entire accumulated score. If you throw a &quot;piggyback&quot; (one pig on top of the other), you''re altogether eliminated!<br/><br/>The variant Hog Call rules allow the other players to risk predicting the outcome of the throw; if predicted successfully, the hog caller earns twice the value of the position *and* deducts that same amount from the roller''s score!<br/><br/>Schweinerei, the German edition, was released by Milton Bradley in 1984; Milton Bradley in 1996; Winning Moves Games (USA) Deutschland in 2001.<br/><br/>', 1977, 2, 10, 8, 30, 30, 30, 1.0683, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (111, 163412, 0, 'patchwork', 'In Patchwork, two players compete to build the most aesthetic (and high-scoring) patchwork quilt on a personal 9x9 game board. To start play, lay out all of the patches at random in a circle and place a marker directly clockwise of the 2-1 patch. Each player takes five buttons &mdash; the currency/points in the game &mdash; and someone is chosen as the start player.<br/><br/>On a turn, a player either purchases one of the three patches standing clockwise of the spool or passes. To purchase a patch, you pay the cost in buttons shown on the patch, move the spool to that patch''s location in the circle, add the patch to your game board, then advance your time token on the time track a number of spaces equal to the time shown on the patch. You''re free to place the patch anywhere on your board that doesn''t overlap other patches, but you probably want to fit things together as tightly as possible. If your time token is behind or on top of the other player''s time token, then you take another turn; otherwise the opponent now goes. Instead of purchasing a patch, you can choose to pass; to do this, you move your time token to the space immediately in front of the opponent''s time token, then take one button from the bank for each space you moved.<br/><br/>In addition to a button cost and time cost, each patch also features 0-3 buttons, and when you move your time token past a button on the time track, you earn &quot;button income&quot;: sum the number of buttons depicted on your personal game board, then take this many buttons from the bank.<br/><br/>What''s more, the time track depicts five 1x1 patches on it, and during set-up you place five actual 1x1 patches on these spaces. Whoever first passes a patch on the time track claims this patch and immediately places it on his game board.<br/><br/>Additionally, the first player to completely fill in a 7x7 square on his game board earns a bonus tile worth 7 extra points at the end of the game. (Of course, this doesn''t happen in every game.)<br/><br/>When a player takes an action that moves his time token to the central square of the time track, he takes one final button income from the bank. Once both players are in the center, the game ends and scoring takes place. Each player scores one point per button in his possession, then loses two points for each empty square on his game board. Scores can be negative. The player with the most points wins.<br/><br/>', 2014, 2, 2, 8, 30, 15, 30, 1.6035, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (112, 14254, 0, 'pitchcar-mini', 'A mini version of Pitchcar with smaller track pieces. Contains 6 straight and 10 curve track pieces that allow the construction of more than 10 different racing circuits. 8 wooden cars are included as well.<br/><br/>', 2003, 2, 8, 6, 30, 30, 30, 1.1438, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (113, 14356, 0, 'pitchcar-mini-extension', 'Expansion pack for PitchCar Mini. It contains two ramps, two straight sections with no jigsaw edge on one end (for a figure of eight track), a straight chicane and four corner chicanes.<br/><br/>Note that there are two editions of this extension. The older edition, as pictured below in the plain box with photocopied label, only contains one jump. The single jump is the same size and shape as both of the jumps from the later edition (in the bright yellow box) placed side by side and has jigsaw edges on both ends. As such it is really more of a steep hill than a jump proper.<br/><br/>', 2004, 2, 8, 6, 30, 30, 30, 1.1111, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (114, 2543, 0, 'pompeji', 'Players build the city of Pompeii in a 7x7 grid using cards that each show various building types, numbers and colors. The same building types and colors may never be placed horizontally or vertically adjacent. During placement, horizontal, vertical and diagonal &quot;streets&quot; emerge, and players score points when they place cards with elements that match other cards along a street. Thus, with each placement, a player has the potential to score points along 4 different streets - 2 diagonal, 1 vertical and 1 horizontal. If a card''s color matches others in a street, the player scores points equal to the highest-valued card of that color. If a card''s building matches others in a street, the player receives the total sum value of all the matching buildings. Players receive a 7-point bonus for placing the 7th building in a road. Players also receive one special building permit card that allows an extra or out-of-turn play and one statue card, which acts as a wild card. The game ends when the second of two volcano cards in the deck is revealed.<br/><br/>', 2001, 2, 4, 12, 45, 45, 45, 1.5556, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (115, 3076, 0, 'puerto-rico', 'In Puerto Rico, players assume the roles of colonial governors on the island of Puerto Rico. The aim of the game is to amass victory points by shipping goods to Europe or by constructing buildings.<br/><br/>Each player uses a separate small board with spaces for city buildings, plantations, and resources. Shared between the players are three ships, a trading house, and a supply of resources and doubloons.<br/><br/>The resource cycle of the game is that players grow crops which they exchange for points or doubloons. Doubloons can then be used to buy buildings, which allow players to produce more crops or give them other abilities. Buildings and plantations do not work unless they are manned by colonists.<br/><br/>During each round, players take turns selecting a role card from those on the table (such as &quot;Trader&quot; or &quot;Builder&quot;). When a role is chosen, every player gets to take the action appropriate to that role. The player that selected the role also receives a small privilege for doing so - for example, choosing the &quot;Builder&quot; role allows all players to construct a building, but the player who chose the role may do so at a discount on that turn. Unused roles gain a doubloon bonus at the end of each turn, so the next player who chooses that role gets to keep any doubloon bonus associated with it. This encourages players to make use of all the roles throughout a typical course of a game.<br/><br/>Puerto Rico uses a variable phase order mechanism in which a &quot;governor&quot; token is passed clockwise to the next player at the conclusion of a turn. The player with the token begins the round by choosing a role and taking the first action.<br/><br/>Players earn victory points for owning buildings, for shipping goods, and for manned &quot;large buildings.&quot; Each player''s accumulated shipping chips are kept face down and come in denominations of one or five. This prevents other players from being able to determine the exact score of another player. Goods and doubloons are placed in clear view of other players and the totals of each can always be requested by a player. As the game enters its later stages, the unknown quantity of shipping tokens and its denominations require players to consider their options before choosing a role that can end the game.<br/><br/>In 2011 and mostly afterwards, Puerto Rico was published to include both Puerto Rico: Expansion I &ndash; New Buildings and Puerto Rico: Expansion II &ndash; The Nobles. These versions are included in the other game entry Puerto Rico, not this regular game entry for Puerto Rico. Some editions of Puerto Rico list the player count as 2-5 instead of 3-5, and they include variant rules for games with only two players.<br/><br/>', 2002, 3, 5, 12, 150, 90, 150, 3.2713, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (116, 232043, 0, 'queendomino', 'Description from the publisher:<br/><br/>Build up the most prestigious kingdom by claiming wheat fields, forests, lakes, grazing grounds, marshes, and mountains. Your knights will bring you riches in the form of coins &mdash; and if you make sure to expand the towns on your lands, you will make new buildings appear, giving you opportunities for new strategies. You may win the Queen''s favors ... but always be aware of the dragon!<br/><br/>Queendomino is a game completely independent from Kingdomino, while offering a choice of more complex challenges. Two to four players can play Queendomino independently, but also in connection with Kingdomino, allowing for games with 7x7 grids for four players, or for up to six players if you stick to 5x5 grids.<br/><br/>', 2017, 2, 4, 8, 25, 25, 25, 2.0526, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (117, 25669, 0, 'qwirkle', 'The abstract game of Qwirkle consists of 108 wooden blocks with six different shapes in six different colors. There is no board, players simply use an available flat surface.<br/><br/>Players begin the game with six blocks. The start player places blocks of a single matching attribute (color or shape but not both) on the table. Thereafter, a player adds blocks adjacent to at least one previously played block. The blocks must all be played in a line and match, without duplicates, either the color or shape of the previous block.<br/><br/>Players score one point for each block played plus all blocks adjacent. It is possible for a block to score in more than one direction. If a player completes a line containing all six shapes or colors, an additional six points are scored. The player then refills his hand to six blocks.<br/><br/>The game ends when the draw bag is depleted and one player plays all of his remaining blocks, earning a six point bonus. The player with the high score wins.<br/><br/>', 2006, 2, 4, 6, 45, 45, 45, 1.5961, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (118, 12, 0, 'ra', 'Ra is an auction and set-collection game with an Ancient Egyptian theme.  Each turn players are able to purchase lots of tiles with their bidding tiles (suns).  Once a player has used up his or her suns, the other players continue until they do likewise, which may set up a situation with a single uncontested player bidding on tiles before the end of the round occurs.  Tension builds because the round may end before all players have had a chance to win their three lots for the epoch.  The various tiles either give immediate points, prevent negative points for not having certain types at the end of the round (epoch), or give points after the final round.  The game lasts for three &quot;epochs&quot; (rounds).  The game offers a short learning curve, and experienced players find it both fast-moving and a quick play.<br/><br/>From the Box:<br/>The game spans 1500 years of Egyptian history in less than an hour!<br/>The players seek to expand their power and fame and there are many ways to accomplish this: Influencing Pharaohs, Building monuments, Farming on the Nile, Paying homage to the Gods, Advancing the technology and culture of the people. Ra is an auction and set collecting game where players may choose to take risks for great rewards or... And all this is for the glory of the Sun God Ra!<br/><br/>', 1999, 2, 5, 12, 60, 45, 60, 2.3369, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (119, 30450, 0, 'railways-of-europe', 'Rails of Europe is an expansion for Railways of the World. Glenn Drover, one of the two designers of the original game, has designed a European setting for the expansion, which uses the original game''s pieces, tiles, money, trains, shares and rules, along with a new map and card deck. There are some rules changed and added for the expansion to reflect the new setting of the expansion.<br/><br/>Due to the complicated corporate history of Eagle Games, this expansion was unusual - it was originally an official, yet unlicensed expansion of Railroad Tycoon. It was official, since the designer of the original game also designed this expansion and it was to be published by a company that is a descendant (of sorts) of Eagle Games.  The expansion is unlicensed because it never bore the Railroad Tycoon name, which was licensed from Sid Meier''s computer game. Its status as an expansion of Railways of the World is much more official, although it existed before the base game of Railways of the World was published.<br/><br/>', 2008, 2, 5, 10, 120, 120, 120, 2.9439, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (120, 17133, 0, 'railways-of-the-world', 'Railways of the World (2009) is the new edition of the base game for Eagle Games'' popular Railways of the World series, first published as Railroad Tycoon in 2005.  It reimplements the original game with several improvements.<br/><br/>Revisit the early days of the Age of Steam as you begin with a locomotive (the venerable John Bull, the first locomotive to run in North America) and a vision (your Tycoon &quot;mission&quot; card). From there, build your budding railroad network into a vast empire. Connect New York to Chicago, earn the most money, develop bigger and faster locomotives and maybe even span North America and build the Transcontinental Railway!<br/><br/>Multiple expansions featuring different maps are available.  Railways of the World is the new base game for the system and includes the engine placards, railroad tiles, train tokens, money, bonds, and other items that are needed in almost all the Railways of the World series. A gameboard depicting the eastern half of the United States is included in the base game, as well as a mounted map of Mexico.<br/><br/>This game is preceded by the designer''s other Winsome train games: Age of Steam, Australian Railways, Volldampf, New England Railways, Veld Spoorweg, Lancashire Railways, and Ferrocarriles Pampas.  Railroad Tycoon was the result of a collaboration with Glenn Drover, in which the mechanics and game-play of Martin Wallace''s Age of Steam were simplified and streamlined and attractive over-produced components were added, in order to make Railroad Tycoon more appealing to less hardcore gamers and more accessible to a wider audience.<br/><br/>A revised reprint was published at the end of 2010 which made some component improvements, such as the addition of Railroad Operation cards for the Mexico map.<br/><br/>Complete series overview - The Railways of the World Series: Introducing the family members of the ideal medium-weight train game<br/><br/>Note: The RailRoad Tycoon board itself is gigantic (about 36x45 inches, 91x114 cm) and requires a huge table or playing on the floor.<br/><br/>Similar to:<br/><br/>     Steam<br/><br/><br/>', 2005, 2, 6, 10, 120, 120, 120, 3.0174, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (121, 12962, 0, 'reef-encounter', 'Reef Encounter is about life on a coral reef! Using polyp tiles, players grow different types of corals, which they can protect from being attacked by other corals through judicious placing of their four shrimp counters. To be successful, players must consume polyps from neighboring corals in order to acquire the ''consumed'' polyp tiles that are the key to the game. The consumed polyp tiles have a myriad of uses (and have a similar effect to the action points in games like Tikal and Java). Most importantly, they can be used to flip over or lock the coral tiles, which determine the respective values of the different types of coral at the end of the game.<br/><br/>Description from the designer, Richard Breese.<br/><br/>Expanded by:<br/><br/>    Reef Encounter of the Second Kind<br/><br/><br/>', 2004, 2, 4, 10, 120, 60, 120, 3.6767, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (122, 22304, 0, 'reef-encounter-of-the-second-kind', 'Reef Encounters of the Second Kind was released at Essen 2006.  It is an expansion set for Reef Encounter, introducing new creatures, opportunities, and tactics to the basic game.<br/><br/>The crown of thorns starfish with their voracious appetites have now found the reef and will consume any corals that they can reach.  Blue shrimps will assist host shrimps in protecting the larger corals, but these blue shrimps are notoriously unreliable.  Meanwhile, the polyp tiles now come in a variety of different forms, and even the rocks are liable to change shape.<br/><br/>A selection of cards provides one-off opportunities to influence the game, to introduce or to move the blue shrimps, or to affect the scoring at the end of the game.  An appropriate card is also required before a parrot fish can consume its first coral.<br/><br/>', 2006, 2, 4, 10, 150, 60, 150, 3.6667, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (123, 216201, 0, 'robo-rally', 'The race is on for the robots of the Robo Rally automobile factory who work long, hard days at the assembly line building highspeed supercars, but never get to see them in action. On Saturday nights, the factory comes to life as the ultimate race course with treacherous obstacles and rival sabotage. In Robo Rally, players move their robots through the course by speeding through corridors and dodging traps to reach each checkpoint first. Only the strongest robots survive!<br/><br/>Enter the world of mad machines and dangerous schemes in the Robo Rally board game. Players control their robot with game cards which reveal directions on how the robots can move through the hectic Robo Rally automobile factory. Use strategy to outsmart rival robots while racing towards each checkpoint in your chosen course in numerical order. Beware of factory obstacles such as industrial lasers, gaping pits, and moving conveyer belts that can make or break the race.<br/><br/>The 2016 edition of Robo Rally differs from earlier versions in a number of ways:<br/><br/><br/>    Players each now have their own deck of twenty cards, with the same cards in each deck. On a turn, a player draws nine cards from their deck, programs five of the cards, then discards the rest. Two cards says &quot;Again&quot; and repeat the action programmed in the previous slot; one card says &quot;Energy&quot; and gives a energy cube which you can use to buy options.<br/><br/><br/><br/>     Since each player has their own deck, the cards no longer have priority numbers to determine who moves first. Now movement order is determined by whoever is closest to a transmitter on the game board.<br/><br/><br/><br/>    When players are damaged, they no longer receive one less card for each damage (or have one of their program registers locked) at the start of a round; instead they receive damage cards that will be shuffled into their decks. &quot;Normal&quot; damage from the board or a robot laser gives you &quot;spam&quot; damage. When you program one of these cards, you remove it from play at the appropriate time and replace it in the register with the top card from your deck. Surprise! Other types of damage exist, with a Trojan horse granting you two spam, a virus infecting nearby players, and a worm forcing you to reboot, which gives you even more damage. By playing the damage, though, you remove it from your deck.<br/><br/><br/>', 2016, 2, 6, 12, 120, 20, 120, 2.3273, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (124, 37380, 0, 'roll-through-the-ages-the-bronze-age', 'In Roll Through the Ages, players roll dice to obtain commodities and workers to build up their civilizations. Dice can be rerolled twice unless they come up as a hazard. Players use their workers to build infrastructure to support additional works or to build monuments that are worth points. At the same time, commodities are gathered that allow your civilization to develop. Once all monuments or five developments are achieved by a player, the game ends at the end of the round, points are counted, and a victor is declared.<br/><br/>The game takes its name from Through the Ages: A Story of Civilization, although the two games have different styles and designers.<br/><br/>', 2008, 1, 4, 8, 45, 30, 45, 1.7813, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (125, 19948, 0, 'rum-pirates', 'Rum and Pirates is a relatively simple movement and collection game, known in German as Um Ru(h)m und Ehre (For Rum/Renown and Honor). The game was designed by Stefan Feld and is for 2-5 players ages 9 and up and plays in 60-75 minutes. On the Alea complexity scale of 1 (simple) to 10 (difficult), this game rates a 2. (Editor''s Note: That is the same complexity as Chinatown, Wyatt Earp, and Edel, Stein & Reich)<br/><br/>The players take on the roles of freebooters who, back in their pirates'' hideout, spend their time with all kinds of competitions - drinking, fighting, etc. All players move the main playing figure, the captain, through the alleys of the village, with the goal of gaining as much rum and reknown as possible. The end of each of the five rounds is also marked by a highly variable fight to claim the best sleeping spaces on board the ship (bed or board?). The game is a mixture of tactics, strategy, and luck. The die plays an important role in the game, but you still get the feeling of being at the mercy of fate only rarely.<br/><br/>The game contains 76 plastic pirate figures, 9 game board pieces that ensure the board is always different, about 200 tiles, and 1 die.<br/><br/>-description adapted from the Gamewire Essen Preview.<br/><br/>This game is #10 in the Alea big box series.<br/><br/>', 2006, 2, 5, 9, 60, 60, 60, 1.9436, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (126, 9217, 0, 'saint-petersburg', 'On May 16th, 1703, Czar Peter laid the cornerstone for the first building in Saint Petersburg. Quickly, glorious buildings were added, always being expanded, so that Nobility (bringing victory points) may want to move in. But to accomplish this, one needs merchants who can provide the necessary Rubles, or the glory is over. The competition isn''t sleeping either, and can sometimes steal a desired card right out from under your nose.<br/><br/>Saint Petersburg has a board to tally victory points and to set out the four types of cards.  It is the cards themselves that players need to collect.  In each round &ndash; with the number of rounds dependent on the number of players and the randomness of card availability &ndash; players first pay for CRAFTSMEN who supply money for further purchases; then BUILDINGS to score points; then ARISTOCRATS, who are needed for money, points, and end-of-game scoring; and finally, unique cards from all three categories which give greater benefits. During the first rounds, players never have enough money to buy every card they want. During later rounds, they have plenty of money, but the cards they''d like to buy may have already come and gone...<br/><br/>Expanded by:<br/><br/>    Sankt Petersburg: Das Bankett<br/>    Saint Petersburg: New Society & Banquet Expansion (includes The Banquet)<br/><br/><br/>', 2004, 2, 4, 10, 60, 45, 60, 2.4593, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (127, 8217, 0, 'san-juan', 'San Juan is a card game based on Puerto Rico. The deck of 110 cards consists of production buildings (indigo, sugar, tobacco, coffee, and silver) and &quot;violet&quot; buildings that grant special powers or extra victory points. Cards from the hand can be either built or used as money to build something else; cards from the deck are used to represent goods produced by the production buildings, in which case they are left face-down. A seven-card hand limit is enforced once per round.<br/><br/>In each round (or governorship), each player in turn selects from one of the available roles, triggering an event that usually affects all players, such as producing goods or constructing buildings. The person who picks the role gets a privilege, such as producing more goods or building more cheaply.<br/><br/>Though similar in concept to Puerto Rico, the game has many different mechanisms. In particular, the game includes no colonists and no shipping of goods; goods production and trading are normally limited to one card per phase; and trades cannot be blocked. Victory points are gained exclusively by building, and the game ends as soon as one player has put up twelve buildings.<br/><br/>', 2004, 2, 4, 10, 60, 45, 60, 2.2856, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (128, 367220, 0, 'sea-salt-paper', 'During their turn, you assemble your hand, maybe place cards for their effect, and decide if you want to end the round. But do you think you are the one with the most points in hand?<br/>You will have to choose: stop the round immediately or give the others an extra turn to try to extend the gap? Is it worth taking the risk? <br/>The game ends when you reach 30/35/40 points (4/3/2 players).<br/><br/>The excitement of ending the round to catch your opponents off guard<br/><br/>The pleasure of playing your effect cards and making combos<br/><br/>Origami created especially for the game!<br/><br/>', 2022, 2, 4, 8, 45, 30, 45, 1.3814, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (129, 18866, 0, 'shear-panic', 'The second game from Fragor Games, featuring a flock of sheep and their attempts to be in the right place at the right time. Much gambolling, some tupping, lots of shearing.<br/><br/>Publisher Blurb:<br/><br/>&quot;''The Best Game Ewe Ever Herd!''<br/><br/>Ah, do ewe long for the life of a sheep? Bright summer days filled with games of tag and attempts to flock closer to Roger, the Heartthrob Ram? But, Watch Out! The shearer wants to drag you away from all the fun and games!<br/><br/>In Shear Panic, ewe maneuver your ewes to score points, playing tag, standing close to Roger, or trying to avoid the shearing scissors! Will your brave sheep score the most points, or will it be &quot;Off with the wool&quot; for ewe?&quot;<br/><br/>The game includes eleven small figurines (which are somewhat fragile): Two each of four different colors, one black, one ''Roger'', and one ''Shearer''. Also included are four player mats in different colors; a timing/scoring mat; 48 mutton buttons in four colors; four scoring markers; one flock marker; and two special six-sided dice.<br/><br/>There are two separate play areas: The one where the flock of sheep figurines are clustered; and the combination timing/scoring mat. (The timing mat is two-sided for 3 or 4 players.) Actions by the players each turn cause the timing marker to move faster or slower through each of the four fields, and the scoring is different in each field.<br/><br/>Field 1 is Team Tag. Players score higher for keeping their sheep closer together. Field 2 is Roger&rsquo;s Field, where players score more the closer they are to Roger (the ram). Field 3 is Black Sheep Tag, and players score higher the closer they are to the black sheep. Field 4 is the Shear Panic Field, and the row of sheep closest to the shearer figure are eliminated each turn, while the remainder are scored individually. The timing marker indicates which Field the sheep are currently &ldquo;in&rdquo;.<br/><br/>Players have a total of twelve actions they may take during the course of the game, and as each one is used, a &ldquo;mutton button&rdquo; is placed over it, eliminating it from future use. Also, the more powerful the action, the farther (faster) the timing marker will move. If the timing marker lands on a red spot, the active player executes a free &ldquo;lamb slam&rdquo; by rolling the Panic Die and moving a sheep of the color rolled one space in any direction. If the Panic Die rolls white, the entire flock does a &ldquo;ewe turn&rdquo; ninety degrees in a direction of the active player&rsquo;s choice.<br/><br/>Since all the player mats are visible to everyone, players need to keep an eye on what moves are still available to their opponents.<br/><br/>The game is intended for three or four players, but rules for a two-player variant are included.<br/><br/>Starting player is the person who most recently was sheared (had their hair cut).<br/><br/>', 2005, 2, 4, 10, 45, 45, 45, 2.2225, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (130, 1269, 0, 'skip-bo', 'Each player is dealt a stockpile of 30 cards. The winner will be whoever manages to empty their stockpile first. Cards are played onto four shared building piles in numerical sequence from 1 to 12. On each turn, a player draws until they have five cards in their hand, and then plays cards from: their hand, a top card of their discard piles, or their stockpile. At the end of their turn, a player must discard onto one of their four personal discard piles. Strategy involves the organizing of cards into the discard piles, care in not setting up the next players for good plays, knowing when to play from which option, and especially the timing of playing a valuable &quot;Skip-bo&quot; wildcard.<br/><br/>Skip-bo is based on Traditional Card Games: Spite and Malice.<br/><br/>', 1967, 2, 6, 8, 20, 20, 20, 1.2078, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (131, 148228, 0, 'splendor', 'Splendor is a game of chip-collecting and card development. Players are merchants of the Renaissance trying to buy gem mines, means of transportation, shops&mdash;all in order to acquire the most prestige points. If you''re wealthy enough, you might even receive a visit from a noble at some point, which of course will further increase your prestige.<br/><br/>On your turn, you may (1) collect chips (gems), or (2) buy and build a card, or (3) reserve one card. If you collect chips, you take either three different kinds of chips or two chips of the same kind. If you buy a card, you pay its price in chips and add it to your playing area. To reserve a card&mdash;in order to make sure you get it, or, why not, your opponents don''t get it&mdash;you place it in front of you face down for later building; this costs you a round, but you also get gold in the form of a joker chip, which you can use as any gem.<br/><br/>All of the cards you buy increase your wealth as they give you a permanent gem bonus for later buys; some of the cards also give you prestige points. In order to win the game, you must reach 15 prestige points before your opponents do.<br/><br/>', 2014, 2, 4, 10, 30, 30, 30, 1.7826, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (132, 2338, 0, 'starship-catan', 'Starship Catan is a two-player card game that is thematically similar to Starfarers of Catan, but has different game play.  Players explore randomly shuffled decks of cards looking for potential colonies, good trading deals, opportunities to help planets, and either avoid or combat pirates.  Players can upgrade their ships'' systems, including weapons to combat the pirates, thrusters to be able to explore further each turn, scanners to see (and avoid) cards that are coming up, and several others.  Victory points are earned by establishing colonies, building upgraded ship''s systems, having the most friendship points, and having the most hero points.  The first player to 10 VP''s wins.<br/><br/>Starship Catan is part of the Kosmos two-player series and the Catan Series.<br/><br/>', 2001, 2, 2, 12, 60, 60, 60, 2.4634, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (133, 34635, 0, 'stone-age', 'The &quot;Stone Age&quot; times were hard indeed. In their roles as hunters, collectors, farmers, and tool makers, our ancestors worked with their legs and backs straining against wooden plows in the stony earth. Of course, progress did not stop with the wooden plow. People always searched for better tools and more productive plants to make their work more effective.<br/><br/>In Stone Age, the players live in this time, just as our ancestors did. They collect wood, break stone and wash their gold from the river. They trade freely, expand their village and so achieve new levels of civilization. With a balance of luck and planning, the players compete for food in this pre-historic time.<br/><br/>Players use up to ten tribe members each in three phases. In the first phase, players place their men in regions of the board that they think will benefit them, including the hunt, the trading center, or the quarry. In the second phase, the starting player activates each of their staffed areas in whatever sequence they choose, followed in turn by the other players. In the third phase, players must have enough food available to feed their populations, or they face losing resources or points.<br/><br/>', 2008, 2, 4, 10, 90, 60, 90, 2.4612, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (134, 13478, 0, 'stratagem', 'From the publisher, Playroom Entertainment:<br/><br/>In StrataGem, players strategically form a 3x3 grid with the best combinations of cards to score the most points, using cards with the same type of gems, same number of gems or gem cards that form a numeric straight. A player may overlap as often as they want, but at the end of the game, points are scored horizontally, vertically and diagonally in the grid. But don''t get your precious jewels snatched away, when opponents attempt to sabotage you with their Gem Thief cards, which will surely keep you on high alert! Put your thinking cap on, stay cool and collected, and you''ll be sure to win the game!<br/><br/>Not to be confused with:<br/><br/>        Stratagem (1998)<br/>        Stratagem (2014)<br/><br/><br/>', 2004, 2, 4, 10, 20, 20, 20, 1.7333, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (135, 139443, 0, 'superfight', 'Superfight is party game of super powers and super problems. The game is all about arguing with your friends about ridiculous fights.<br/><br/>The core deck contains 500 cards. 160 characters (white cards), and 340 powers and weaknesses (black cards). Players use a hand of three white cards and three black cards, and choose one of each to beat the player next to them. Then they get a random black card before fighting. Players then argue their case for why they should win, and the table votes.<br/><br/>Note: Superfight went through a major reprint in late 2014. The rules and about 30% of the cards were refined to improve the game after it sold out of its original print runs. The Cards Against Humanity/Apples to Apples mechanism has been replaced by a table vote and one-one one battles, but the battle royale and villain rulesets keep the old single-judge mechanism if the table prefers it.<br/><br/>', 2013, 3, 20, 8, 15, 15, 15, 1.193, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (136, 432, 0, 'take-5', 'In 6 nimmt!, a.k.a. Category 5 and many other names, you want to score as few points as possible.<br/><br/>To play the game, you shuffle the 104 number cards, lay out four cards face-up to start the four rows, then deal ten cards to each player. Each turn, players simultaneously choose and reveal a card from their hand, then add the cards to the rows, with cards being placed in ascending order based on their number; specifically, each card is placed in the row that ends with the highest number that''s below the card''s number. When the sixth card is placed in a row, the owner of that card claims the other five cards and the sixth card becomes the first card in a new row.<br/><br/>In addition to a number from 1 to 104, each card has a point value. After finishing ten rounds, players tally their score and see whether the game ends. (Category 5 ends when a player has a score greater than 74, for example, while 6 nimmt! ends when someone tops 66.) When this happens, the player with the fewest points wins!<br/><br/>6 nimmt! works with 2-10 players, and the dynamics of gameplay change the more players that you have. One variant for the game has you use 34 cards, 44 cards, 54 cards, etc. (instead of all 104 cards) when you have three, four, five, etc. number of players. This change allows you to know which cards are in play, thereby allowing you to track which cards have been played and (theoretically) make better choices as to which card to play when.<br/><br/>', 1994, 2, 10, 8, 45, 45, 45, 1.1956, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (137, 70919, 0, 'takenoko', 'A long time ago at the Japanese Imperial court, the Chinese Emperor offered a giant panda bear as a symbol of peace to the Japanese Emperor. Since then, the Japanese Emperor has entrusted his court members (the players) with the difficult task of caring for the animal by tending to his bamboo garden.<br/><br/>In Takenoko, the players will cultivate land plots, irrigate them, and grow one of the three species of bamboo (Green, Yellow, and Pink) with the help of the Imperial gardener to maintain this bamboo garden. They will have to bear with the immoderate hunger of this sacred animal for the juicy and tender bamboo. The player who manages his land plots best, growing the most bamboo while feeding the delicate appetite of the panda, will win the game.<br/><br/>', 2011, 2, 4, 8, 45, 45, 45, 1.9779, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (138, 1038, 0, 'tantrix', 'Tantrix is a strategy game using painted synthetic resin hexagons (often mistakenly thought to be Bakelite). It was invented in New Zealand, and is clearly derived from the earlier Psyche-paths/Kaliko. Tantrix can be played as solitaire puzzles, ranging from easy to almost impossible, or as a multiplayer strategy game featuring a combination of strategy, luck and skill. Each tile has three tracks on it, in three different colors (out of four colors). Each track starts on one side of the tile and ends on another. The goal of the game is to create the longest line or loop of your chosen color. If you create a closed loop, each tile counts for two points.<br/><br/>Each player has an open hand of six tiles. When it is your turn, you must first play tiles in any spaces that are &quot;required play&quot; (any hole that has at least three tiles bordering it is a required play). After each played tile, you randomly draw a new tile. Once you''ve filled all required spaces, you play one tile in any legal space. After that, you once again need to fill required spaces. To play the game well, you need to create required spaces in smart ways. This way you can both enable yourself to play more tiles during your turn and force your opponent to play tiles that continue your track (remember that your opponent''s hand is open, so try to create required spaces that take advantage of his tiles).<br/><br/>The full version contains 56 tiles.<br/><br/>Note that there are also smaller solo brain teaser puzzles that are Outside the Scope of BGG. The 10-tile version is a color matching puzzle. Arrange the tiles so that all the colored lines match where the tiles touch each other. Additionally, for each puzzle challenge, select one color, and create a closed loop. Begin the easy puzzle by using the first four tiles (which are numbered on the reverse side 1, 2, 3 &amp; 4). Increase the level of difficulty by adding the fifth tile, then 6th tile etc. Comes in Green &amp; Black.<br/><br/>Similar to:<br/><br/>    Tantrix Gobble<br/>    The Mind Game<br/>    Kaliko (Psyche-Paths)<br/><br/><br/>', 1991, 1, 6, 8, 30, 30, 30, 2.2138, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (139, 6779, 0, 'the-ark-of-the-covenant', 'A game based on Carcassonne, Ark of the Covenant has players vie for control of cities, roads, flocks, and temples by using the tiles to create the dynamic play area and by placing followers on the tiles.<br/><br/>New features compared to Carcassonne include oases along roads which award 1 additional point to that road for each oasis, a one-time use &quot;prophet&quot; for each player which doubles the value of a completed city for that player, a simplified field scoring with each sheep in the field adding 2 points and each wolf subtracting 2 points, and a new scoring mechanism for temples. Additionally, players can forgo the placement of a follower on the board to move the Ark around the tiles and award 1 point to the owner of each follower it passes.<br/><br/>Part of the Carcassonne series.<br/><br/>', 2003, 2, 5, 8, 30, 30, 30, 1.9246, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (140, 619, 0, 'the-bottle-imp', 'In this trick-taking game based on the short story by Robert Louis Stevenson of the same name, the goal is to gain the most points over a series of hands (usually the goal is set to 200 pts). Cards are numbered 1-37 and are found in three colors, red (comprising largely the highest numbers), blue (mostly in the middle) and yellow (mostly the lowest numbers) with colors being analogous to the suit in a standard deck.  There is one neutral card, the 19, that sets the &quot;price of the bottle.&quot;<br/><br/>The entire deck is dealt to the three or four players in the game and then, similarly to hearts, cards are exchanged and a card is played to the bottle.  As per the usual elements of a trick taking game, players must follow suit if possible with high card taking the trick (regardless of suit).  The unique feature about this game however is how trump is determined.  Any card of value lower than the current price of the bottle (starting with 19) is considered &quot;trump&quot; and will win the trick.  If multiple cards are less than the current bottle price, the card valued closest to the current price (so highest card below the bottle) takes the trick AND THE BOTTLE, the bottle price is adjusted by the player taking the card that represents the current bottle price and replacing it with the card they used to win the trick.  Thus the price of the bottle will decrease with each trump card played, and the bottle is increasingly harder to win/purchase.  Ownership of the bottle will pass from player to player and the number of possible trump cards will decrease both as a factor of cards being played and cards being skipped as the bottle price descends.  One player will be stuck with the bottle at the end of a hand (when players have played all the cards in their hands).<br/><br/>Cards have point values from 1-6 (not directly based on numerical value), at the end of the hand players will score points for the cards of tricks they''ve won, except the player who holds the bottle who will score NEGATIVE points for all the cards played to the bottle at the beginning, scoring nothing for the cards they won during the hand.  Play continues until the point goal is reached.<br/><br/>In the 2003 edition the complete story by R.L. Stevenson <a target=''_blank'' href="http://gaslight.mtroyal.ab.ca/bottlimp.htm" rel="nofollow noreferrer noopener">http://gaslight.mtroyal.ab.ca/bottlimp.htm</a> is included (in both English &amp; German) and the bottle is a nice wooden piece.  Earlier versions had a stand-up cardboard piece that you cut out.<br/><br/>', 1995, 2, 4, 10, 30, 30, 30, 1.8699, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (141, 3141, 0, 'the-bucket-king', 'Card game with unusual scoring. Players play sets of animal cards trying to knock over each other''s pyramids of buckets. Cards in hand can be used to attack and defend their colour buckets, taking out lower buckets causes cascades.<br/><br/>The deck is five colours (farm animals) numbered 1-8, with two 1s and two 8s. Players start with 12 cards.  The start player plays 1-3 cards of one colour, giving a total sum. This total attacks the player to their left, who either plays 1-3 cards of the same colour totalling higher to defend, or loses a bucket. If they do defend though, that total then attacks the player to their left and so on, round the table. If it gets back to the start player, then can add 1-3 more cards to their original play, increasing the total. At some point, a player cannot defend, and buckets go tumbling. If you match the total attacking you this reverses the direction of play, meaning the cards already played are being added to additional cards to create high totals.<br/><br/>Players look at their starting hand before building their pyramid o'' buckets, so it pays to put your weak colours at the top.<br/><br/>If you play a cards or cards, you draw back only one card from the draw deck. If you forget, tough! The game ends when a pre-set number of players lose all their buckets, the number increases with the number playing. The player with the most remaining is the winner.<br/><br/>A game comes with enough buckets for 6 players, but you can play with multiple sets to allow larger groups to play. This works well as action down the far end of the table means you are safe, while the reversal mechanism means that there can be a build up of a lead to an unmatchable number before it breaks out of that end of the table.<br/><br/>Seemingly a game of luck, but noticable that the same players keep winning and with experience the winning margins keep getting reduced.<br/><br/>', 2002, 2, 6, 10, 45, 45, 45, 1.2316, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (142, 144553, 0, 'the-builders-middle-ages', 'In The Builders: Middle Ages, the cards represent buildings or workers. Players score points (and gain money) by completing the construction of buildings, while placing a worker on a construction site costs money. Each building has four characteristics (carpentry, masonry, architecture, tilery) rated between 0 and 5, and the workers have the same characteristics valued in the same range. To complete a construction, the player must add enough workers to cover the four characteristics of the building.<br/><br/>Each player starts the game with 10 ecu and an apprentice. Five workers and five buildings are placed face-up on the table, with the others set aside in separate decks. On a turn, you can take three free actions, then pay 5 ecu for each additional action. The possible actions are:<br/><br/><br/>    Open a site - Take one of the five buildings, place it front of you, then draw a replacement from the deck.<br/>    Recruit a worker - Take one of the five workers, place it front of you, then draw a replacement from the deck.<br/>    Assign a worker to a building - Pay the cost of the worker (as he won''t work for free!), then place him on a building; when the building''s needs are met, you earn the points and coins indicated, then flip the building over. The workers return to your pool of available labor.<br/>    Get money - Forgo one, two or three actions to earn 1, 3 or 6 ecu.<br/><br/><br/>Some completed buildings join your labor pool as they can be used to complete other buildings. As soon as a player reaches 17 points, players finish the round so that everyone has the same number of turns, then you tally points, with each completed card having a point value and each 10 ecu being worth 1 point. Whoever has the most points wins.<br/><br/>', 2013, 2, 4, 10, 30, 30, 30, 1.7962, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (143, 84876, 0, 'the-castles-of-burgundy', 'The game is set in the Burgundy region of High Medieval France. Each player takes on the role of an aristocrat, originally controlling a small princedom. While playing they aim to build settlements and powerful castles, practice trade along the river, exploit silver mines, and use the knowledge of travelers.<br/><br/>The game is about players taking settlement tiles from the game board and placing them into their princedom which is represented by the player board. Every tile has a function that starts when the tile is placed in the princedom. The princedom itself consists of several regions, each of which demands its own type of settlement tile.<br/><br/>The game is played in five phases, each consisting of five rounds.  Each phase begins with the game board stocked with settlement tiles and goods tiles.  At the beginning of each round all players roll their two dice, and the player who is currently first in turn order rolls a goods placement die.  A goods tile is made available on the game board according to the roll of the goods die.  During each round players take their turns in the current turn order.  During his turn, a player may perform any two of the four possible types of actions: 1) take a settlement tile from the numbered depot on the game board corresponding to one of his dice and place it in the staging area on his player board, 2) take a settlement tile from the staging area of his player board to a space on his player board with a number matching one of his dice in the corresponding region for the type of tile and adjacent to a previously placed settlement tile, 3) deliver goods with a number matching one of his dice, or 4) take worker tokens which allow the player to adjust the roll of his dice.  In addition to these actions a player may buy a settlement tile from the central depot on the game board and place it in the staging area on his player board.  If an action triggers the award of victory points, those points are immediately recorded.  Each settlement tile offers a benefit, additional actions, additional money, advancement on the turn order track, more goods tiles, die roll adjustment or victory points.  Bonus victory points are awarded for filling a region with settlement tiles.<br/><br/>The game ends after the fifth phase is played to completion.  Victory points are awarded for unused money and workers, and undelivered goods.  Bonus victory points from certain settlement tiles are awarded at the end of the game.<br/><br/>The player with the most victory points wins.<br/><br/>The rules include basic and advanced versions.<br/><br/>This game is #14 in the Alea big box series.<br/><br/>There is a separate BGG entry for the 2019 edition: The Castles of Burgundy.  The 2019 edition includes, alongside the base game, eight expansions, seven of which had already been released separately as promotional items and one new to the 2019 release.<br/><br/>UPC 4005556812431<br/><br/>', 2011, 2, 4, 12, 90, 30, 90, 2.9857, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (144, 41964, 0, 'the-little-prince', 'From the box:<br/><br/>A family game based on the motion picture adapted from the internationally popular book by Antoine de Saint-Exupery.<br/><br/>From the instructions:<br/><br/>The object of the game is to be the first to either:<br/><br/>1.  Travel the entire length of the path, OR<br/><br/>2.  Complete a &quot;Quotation Sequence&quot; using the quotation cards and/or wild (rose) cards.<br/><br/>', 1974, 2, 4, 6, 60, 60, 60, 0.0, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (145, 24480, 0, 'the-pillars-of-the-earth', 'Die S&auml;ulen der Erde / The Pillars of the Earth is based on the bestselling novel by Ken Follett and the 2006 game in the Kosmos line of literature-based games.<br/><br/>At the beginning of the 13th century, construction of the greatest and most beautiful cathedral in England begins. Players are builders who try to contribute the most to this cathedral''s construction and, in so doing, score the most victory points.  Gameplay roughly consists of using workers to produce raw materials, and then using craftsmen to convert the materials into victory points.  Workers may also be used to produce gold, the currency of the game.  Players are also given three master builders each turn, each of which can do a variety of tasks, including recruiting more workers, buying or selling goods, or just obtaining victory points.  Getting early choices with a master builder costs gold, as does purchasing better craftsmen.  Players must strike a balance between earning gold to fund their purchases and earning victory points.<br/><br/>Expanded by:<br/><br/><br/>     The Pillars of the Earth Expansion Set (which include the Expansion Cards in some editions)<br/>     The Pillars of the Earth: Expansion Cards (which are included in the Expansion Set in some editions)<br/><br/><br/>', 2006, 2, 4, 12, 120, 90, 120, 2.8144, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (146, 555, 0, 'the-princes-of-florence', 'In The Princes of Florence, players attract artists and scholars to their palace while trying to become the most prestigious family in Florence.<br/><br/>Over seven rounds, players attempt to score points in various ways, with most points being earned by playing profession cards to generate &quot;work points&quot;, which can be exchanged for money or victory points. The game includes a variety of professions, such astronomers, organists, and architects; each profession is attracted to a particular combination of building, landscape feature, and social freedom, and players acquire these items via auctions. The more that a player can match these preferences, the more work points they earn &mdash; but the minimum requirement of work points increases each round, and you must meet that threshold in order to convert the work points.<br/><br/>', 2000, 1, 5, 12, 100, 75, 100, 3.2422, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (147, 152959, 0, 'the-settlers-of-catan', 'This entry is for editions of CATAN that include the Catan: 5-6 Player Extension.<br/><br/><br/>Publisher''s description of the 15th Anniversary Edition:<br/><br/>Embark on a quest to settle the fair isle of Catan! Guide your brave settlers to victory by using clever trading and development. Use resources (grain, wool, ore, brick, and lumber) to build roads, settlements, and cities, and buy development cards. Acquire your resources through trades or the role of the dice. But beware! You never know when someone might cut off your road or if the robber will appear and steal your precious gains. Are you the best trader, builder, or settler? Will you master Catan?<br/><br/>Designed for 3-6 players, this special, limited 15th Anniversary Wood Edition of The Settlers of Catan features a strong, compartmentalized box that contains: 52 thick, beautifully illustrated map hexagons, 144 specially designed playing pieces, six hexagonal building costs summaries, two special victory point markers, one vile robber, two dice, and 28 random number chits, all crafted from sturdy wood. The 154 cards, like the hexes, bear fine artwork from Michael Menzel.<br/><br/>', 2008, 3, 6, 10, 75, 60, 75, 2.4348, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (148, 245206, 0, 'the-x-files-circle-of-truth', 'Another bizarre case has come across the desks of Agents Mulder and Scully. Each agent has their own conclusion &ndash; a paranormal event, or a rational explanation &ndash; but only one can collect enough evidence to close the case!<br/><br/>Micro card game included in the January 2018 Loot Crate.<br/><br/>Contains 18 double-sided cards, 2 character cards, instruction booklet, and plastic wallet for holding the game.<br/><br/>Each double-sided card features four rectangular areas on the back and a scoring rule on the front. You deal out three scoring rules at random, and then arrange the remaining 15 cards face down in a circle. Players take turns drafting the cards to build their case. The player whose case is worth the most points at the end wins.<br/><br/>', 2018, 2, 2, 0, 0, 0, 0, 1.25, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (149, 20806, 0, 'three-dragon-ante', 'Three-Dragon Ante is a fast-paced noncollectable card game based on the games of chance played by characters within the D&amp;D game world. Three-Dragon Ante can be played as a standalone card game, or it can be played as part of a roleplaying campaign-where the abilities of each player&acute;s character give him or her a unique winning edge.<br/><br/>Three-Dragon Ante is a force-bid game where the pot goes to the player who built the best dragon flight this round. Each turn you play a card into your &quot;flight&quot;, and if equal in strength or weaker than the dragon played by the prior player, that dragon''s power activates (draw cards, take cards from opponents, steal from the pot, etc).  Game ends once one player goes bankrupt.<br/><br/>Integrates with:<br/><br/>    Three-Dragon Ante: Emperor''s Gambit<br/><br/><br/>Expanded by:<br/><br/>    Luck of the Draw (RPGGeek item)<br/><br/><br/>', 2005, 2, 6, 12, 20, 20, 20, 1.726, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (150, 21790, 0, 'thurn-and-taxis', 'In Thurn &amp; Taxis, players build post office routes across Bavaria and the regions around, collecting bonus points in various ways. The board shows a map of all the cities, with roads leading from each one to some of its neighbors. There are various colored regions around the board, most with two or three cities, and a large region with all the Bavarian cities in the center.<br/><br/>Players build postal routes from city to city to city so that each city is adjacent to the next city on the route and there is a road connecting these two cities. Each route must consist of at least three cities. Players may build only one route at a time. Routes are represented by melded city cards arranged in the order of the route.<br/><br/>Players start with a supply of 20 post offices in their color, a carriage house card, and a player aid card. The board is populated with bonus tiles, carriage cards and city cards. On a turn, a player will draw a card from a display of six, face-up city cards (or the top of the face-down deck) and meld one card, either starting a new route or adding to the current one. If after adding to the route, the length of the route is at least three cities, the player may declare it finished and score it. The player may, depending on the length of the route and which cities are in the route, place post offices in the cities, collect bonus tiles, and acquire a higher value carriage. Optionally, the player may receive support from one postal official in the form of drawing a second card, melding a second card, refreshing the six city card display, or acquiring a higher value carriage than the route length when finishing a route. Once a route is scored, the city cards of that route are discarded, and the player begins a new route on their next turn.<br/><br/>When a player exhausts their supply of post offices or acquires a value 7 carriage, the end of the game is triggered. Play continues until the player who is last in turn order finishes their turn, and the game ends. Players score points for their highest valued carriage and bonus tiles, then lose points for unplaced post offices. The player with the most points wins.<br/><br/>The fact that you *must* add at least one city to your route each turn or lose the whole route gives the game an enjoyable planning element.<br/><br/>', 2006, 2, 4, 10, 60, 60, 60, 2.2599, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (151, 27690, 0, 'thurn-and-taxis-power-and-glory', 'From <a target=''_blank'' href="http://riograndegames.com/games.html?id=189" rel="nofollow noreferrer noopener">http://riograndegames.com/games.html?id=189</a><br/><br/>The postal carriages continue to roll. Now that players have learned to master the postal routes in the south, they naturally turn their eyes toward the north, looking for more routes to establish to add to their ever-growing postal networks. The new routes run between Holland and Sachsen - between Preu&szlig;en and the free cities. The players build new postal stations in order to provide fast service for important letters to the many new customers in the north.<br/> Hard-working postal carriers add horses to their carriages to enable them to travel farther and more safely, which will help the separated Preu&szlig;en provinces to achieve power and glory.<br/><br/>With this expansion, we offer new ways for players to enjoy Thurn and Taxis. The new board opens up new areas for postal routes. To support the new board, we include new bonus tiles and new city cards (with horses on their backs to support the new rules). We hope players will enjoy these changes and the strategic opportunities they offer.<br/><br/>', 2007, 2, 4, 10, 60, 60, 60, 2.3138, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (152, 9209, 0, 'ticket-to-ride', 'With elegantly simple gameplay, Ticket to Ride can be learned in under 15 minutes. Players collect cards of various types of train cars they then use to claim railway routes in North America. The longer the routes, the more points they earn. Additional points come to those who fulfill Destination Tickets &ndash; goal cards that connect distant cities; and to the player who builds the longest continuous route.<br/><br/>&quot;The rules are simple enough to write on a train ticket &ndash; each turn you either draw more cards, claim a route, or get additional Destination Tickets,&quot; says Ticket to Ride author, Alan R. Moon. &quot;The tension comes from being forced to balance greed &ndash; adding more cards to your hand, and fear &ndash; losing a critical route to a competitor.&quot;<br/><br/>Ticket to Ride continues in the tradition of Days of Wonder''s big format board games featuring high-quality illustrations and components including: an oversize board map of North America, 225 custom-molded train cars, 144 illustrated cards, and wooden scoring markers.<br/><br/>Since its introduction and numerous subsequent awards, Ticket to Ride has become the BoardGameGeek epitome of a &quot;gateway game&quot; -- simple enough to be taught in a few minutes, and with enough action and tension to keep new players involved and in the game for the duration.<br/><br/>Part of the Ticket to Ride series.<br/><br/>', 2004, 2, 5, 8, 60, 30, 60, 1.8326, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (153, 106645, 0, 'ticket-to-ride-map-collection-2-india-switzerland', 'Days of Wonder''s Ticket to Ride Map Collection is a series of expansions for Alan R. Moon''s Ticket to Ride, with each expansion including a double-sided game board and destination tickets and rules for those locations.<br/><br/>Ticket to Ride Map Collection: Volume 2 - India &amp; Switzerland presents players with two scenarios:<br/><br/>&bull; India from Ian Vincent &ndash; On this game board for 2-4 players, in addition to scoring points for claiming routes and completing tickets, a player can also score points in two other ways. First, the player with the longest continuous path of trains receives a ten point bonus. Second, each player scores bonus points for connecting the cities on one or more tickets with two distinct routes. The first two such tickets earn five additional points each, and the next three earn ten points each for a maximum bonus of 40 points.<br/><br/>&bull; Switzerland from Alan R. Moon &ndash; This is a reprint of Ticket to Ride: Switzerland, first published in 2007. This game board is for 2-3 players only. Instead of connecting only cities, some destination tickets connect a city to a country or one country to any of those surrounding Switzerland; a player who completes such a ticket scores the highest point value for which they qualify. Unlike most other TtR games, discarded tickets are removed from the game instead of being returned to the ticket deck. Also, Locomotives can be used only to build tunnels.<br/><br/>Part of Ticket to Ride series.<br/><br/>', 2011, 2, 4, 8, 60, 30, 60, 2.0259, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (154, 131188, 0, 'ticket-to-ride-map-collection-3-the-heart-of-africa', 'Game description from the publisher:<br/><br/>Set in the vast wilderness of Africa at the height of its exploration by intrepid explorers, missionaries and adventurers, Ticket to Ride Map Collection: Volume 3 - The Heart of Africa, a single-sided expansion map for Ticket to Ride or Ticket to Ride: Europe, focuses on the central and southern &quot;heart&quot; of the continent displayed in a vertical format.<br/><br/>This expansion introduces 45 new terrain cards, divided into three different terrain types. Each type is associated with different route colors: Desert/Savanna cards for yellow, orange and red routes; Jungle/Forest cards for green, blue and purple routes; and Mountain/Cliff cards for black, white and grey routes. Players can draw terrain cards just like train cards and they may use these to double the value of the routes they claim, under certain conditions.<br/><br/>Part of Ticket to Ride series.<br/><br/>', 2012, 2, 5, 8, 60, 30, 60, 2.0495, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (155, 160069, 0, 'ticket-to-ride-10th-anniversary', 'Ticket to Ride: 10th Anniversary contains material from the Ticket to Ride base game and the USA 1910 expansion:<br/><br/><br/>    30 Classic Destination Tickets<br/>    35 Destination Tickets from USA 1910<br/>    4 Destination Tickets from Mystery Train<br/>    1 Longest Route/Globetrotter Bonus card<br/><br/><br/>In Ticket to Ride, players collect cards of various types of train cars they then use to claim railway routes in North America. The longer the routes, the more points they earn. Additional points come to those who fulfill Destination Tickets &ndash; goal cards that connect distant cities; and to the player who builds the longest continuous route.<br/><br/>Part of Ticket to Ride series.<br/><br/>', 2014, 2, 5, 8, 60, 30, 60, 1.8959, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (156, 14996, 0, 'ticket-to-ride-europe', 'Ticket to Ride: Europe takes you on a new train adventure across Europe. From Edinburgh to Constantinople and from Lisbon to Moscow, you''ll visit great cities of turn-of-the-century Europe. Like the original Ticket to Ride, the game remains elegantly simple, can be learned in 5 minutes, and appeals to both families and experienced gamers. Ticket to Ride: Europe is a complete, new game and does not require the original version.<br/><br/>More than just a new map, Ticket to Ride: Europe features brand new gameplay elements. Tunnels may require you to pay extra cards to build on them, Ferries require locomotive cards in order to claim them, and Stations allow you to sacrifice a few points in order to use an opponent''s route to connect yours. The game also includes larger format cards and Train Station game pieces.<br/><br/>The overall goal remains the same: collect and play train cards in order to place your pieces on the board, attempting to connect cities on your ticket cards. Points are earned both from placing trains and completing tickets but uncompleted tickets lose you points. The player who has the most points at the end of the game wins.<br/><br/>Copyright 2002-2014 Days of Wonder, inc.<br/><br/>Part of the Ticket to Ride series.<br/><br/>', 2005, 2, 5, 8, 60, 30, 60, 1.9207, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (157, 21348, 0, 'ticket-to-ride-marklin', 'Ticket to Ride: M&auml;rklin is the third installment in Days of Wonder''s best-selling Ticket to Ride series.  The board for M&auml;rklin is based on a map of Germany and each individual card in the deck depicts a different M&auml;rklin Trains model.  A DVD introducing players to the M&auml;rklin line of model trains is included [Edit: DVD no longer included in recent runs.]<br/><br/>M&auml;rklin is a heavier version in the TTR series, allowing players to not only travel from city to city but also from cities to countries. A new mechanic is also introduced in the form of passengers and merchandise tokens. When the game is set-up a series of merchandise values worth victory points are placed on nominated cities. The values of these tokens diminish when multiple tokens are present within a single city, requiring players to move quickly to capture the higher valued tokens.<br/><br/>These tokens can be collected by the players by placing their Passengers (3 per player), which can be achieved at the end of a turn in which a player lays trains to enter the city in question. Once a passenger is in play a player can forfeit their regular turn to move a passenger. Moving along a player''s own train network comes at no cost and allows a player to take the top merchandise token from each city that is passed through. A passenger can also move along sections of track featuring other players trains but a passenger card must be paid each time this occurs to do so.<br/><br/>The player who completes the most destination tickets receives a 10 point bonus (instead of the base game''s longest route bonus).<br/><br/>', 2006, 2, 5, 8, 60, 30, 60, 2.2436, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (158, 202670, 0, 'ticket-to-ride-rails-sails', 'Ticket to Ride: Rails &amp; Sails takes the familiar gameplay of Ticket to Ride and expands it across the globe &mdash; which means that you''ll be moving across water, of course, and that''s where the sails come in.<br/><br/>As in other Ticket to Ride games, in Ticket to Ride: Rails &amp; Sails players start with tickets in hand that show two cities, and over the course of the game they try to collect colored cards, then claim routes on the game board with their colored train and ship tokens, scoring points while doing so. When any player has six or fewer tokens in their supply, each player takes two more turns, then the game ends. At that point, if they''ve created a continuous path between the two cities on a ticket, then they score the points on that ticket; if not, then they lose points instead.<br/><br/>Ticket to Ride: Rails &amp; Sails puts a few twists on the TtR formula, starting with split card decks of trains and ships (with all of the wild cards going in the train deck). Three cards of each type are revealed at the start of the game, and when you draw cards, you replace them with a card from whichever deck you like. (Shuffle the card types separately to form new decks when needed.)<br/><br/>Similarly, players choose their own mix of train and ship tokens at the start of the game. To claim a train route (rectangular spaces), you must play train cards (or wilds) and cover those spaces with train tokens, and to claim a ship route (oval spaces), you must play ship cards (or wilds) and cover those spaces with ship tokens. Ship cards depict one or two ships on them, and when you play a double-ship card, you can cover one or two ship spaces. You can take an action during play to swap train tokens for ships (or vice versa), and you lose one point for each token you swap.<br/><br/>Some tickets show tour routes with multiple cities instead of simply two cities. If you build a network that matches the tour exactly, you score more points than if you simply include all of those cities in your network.<br/><br/>Each player also starts the game with three harbors. If you have built a route to a port city, you can take an action during the game to place a harbor in that city (with a limit of one harbor per port). To place the harbor, you must discard two train cards and two ship cards of the same color, all of which must bear the harbor symbol (an anchor). At the end of the game, you lose four points for each harbor not placed, and you gain 10-40 points for each placed harbor depending on how many of your completed tickets show that port city.<br/><br/>Ticket to Ride: Rails &amp; Sails includes a double-sided game board, with one side showing the world and the other side showing the Great Lakes of North America. Players start with a differing number of cards and tokens depending on which side they play, and each side has a few differences in gameplay.<br/><br/>Part of Ticket to Ride series.<br/><br/>', 2016, 2, 5, 10, 120, 60, 120, 2.5, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (159, 24439, 0, 'ticket-to-ride-usa-1910', 'Ticket to Ride: USA 1910 is a card expansion for the original Ticket to Ride boardgame, winner of the 2004 Spiel des Jahres. It contains 181 large format cards (the same size as Ticket to Ride: Europe and Ticket to Ride: Mrklin).  This includes 35 new 1910 Destination Tickets, a GlobeTrotter Bonus card for completing the most tickets, 4 Mystery Train Destination Tickets originally provided in the Ticket to Ride: Mystery Train Expansion expansion, and a complete replacement deck of the 141 cards from the original game deck (30 Destination Tickets (4 cards have a reduced value from Ticket to Ride), 110 Train Cards, and 1 Longest Route Bonus Card (Trans America Express)).<br/><br/>The rulebook is from the original game designer Alan R. Moon that gives you three additional different ways to play the game:<br/><br/>     The 1910 Rules: Played as the standard Ticket to Ride, but using only the 1910 Destination Tickets, and GlobeTrotter Bonus card.<br/>     The Big Cities Rules: Played with only the newly identified 35 &quot;Big City&quot; Destination Tickets (15 Standard Tickets, 19 1910 Tickets, and 1 Mystery Train Ticket).<br/>     The Mega Game: featuring all of the game''s Destination Tickets and Bonus Cards (30 Standard Tickets, 35 1910 Tickets, 4 Mystery Train Tickets, and both Bonus cards).<br/><br/><br/>Part of Ticket to Ride series.<br/><br/>', 2006, 2, 5, 8, 60, 30, 60, 1.8991, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (160, 42, 0, 'tigris-euphrates', 'Regarded by many as Reiner Knizia''s masterpiece, Tigris &amp; Euphrates is set in the ancient fertile crescent with players building civilizations through tile placement. Players are given four different leaders: farming, trading, religion, and government. The leaders are used to collect victory points in these same categories. However, your score at the end of the game is the number of points in your weakest category, which encourages players not to get overly specialized. Conflict arises when civilizations connect on the board, i.e., external conflicts, with only one leader of each type surviving such a conflict. Leaders can also be replaced within a civilization through internal conflicts.<br/><br/>Starting in the Mayfair edition from 2008, Tigris &amp; Euphrates included a double-sided game board and extra components for playing an advanced version of the game. This &quot;ziggurat expansion&quot;, initially released as a separate item in Germany for those who already owned the base game, is a special monument that extends across five spaces of the board. The monument can be built if a player has a cross of five civilization tokens of the same color by discarding those five tokens and replacing them with the ziggurat markers, placing a ziggurat tower upon the middle tile. The five ziggurat markers cannot be destroyed. All rules regarding monuments apply to the ziggurat monument as well. If your king is inside the kingdom of the ziggurat, you will get one victory point in a color of your choice at the end of your turn.<br/><br/>Some versions of Tigris &amp; Euphrates are listed as being for 2-4 players, while others incorrectly state that they''re for 3-4 players. Tigris &amp; Euphrates is part of what is sometimes called Reiner Knizia''s tile-laying trilogy.<br/><br/>', 1997, 2, 4, 12, 90, 90, 90, 3.5013, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (161, 691, 0, 'timbuktu', 'In this game each player takes the role of a caravan leader. The number of camels within a caravan depends on the number of players. Each camel is loaded with a lot of goods, and the goal of the game is to carry all the goods from the starting position to the final oasis: Timbuktu.<br/><br/>However, during the course of this journey, the caravans stop at other oases. Once all camels arrive at an oasis, and night falls, thieves attack the caravan and steal different goods. While moving from one oasis to another, players receive different clues about the nature of the thefts. Each player has a different clue, and although clues are passed around, only one player receives three of the total five clues. From the actions of the other players (caravan leaders), the clues have to be guessed and camels have to be relocated, in order to save all the goods from the thieves.<br/><br/>The next morning, the caravan continues its way towards Timbuktu, and players are challenged with different clues again. The object of the game is to be the trader left with the most value in goods when they arrive at Timbuktu.<br/><br/>', 1993, 3, 5, 10, 60, 60, 60, 2.7792, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (162, 128664, 0, 'timeline', 'Timeline is a card game where each card depicts a historical event, invention or discovery on both sides, with the year in which that event occurred, invention or discovery was made on only one side. Players take turns placing a card from their hand in a row on the table. After placing the card, the player reveals the date on it. If the card was placed correctly with the date in chronological order with all other cards on the table, the card stays in place; otherwise the card is removed from play and the player takes another card from the deck.<br/><br/>The first player to get rid of all his cards by placing them correctly wins. If multiple players go out in the same round, then everyone else is eliminated from play and each of those players are dealt one more card for another round of play. If only one player has no cards after a bonus round, he wins; otherwise play continues until a single player goes out.<br/><br/>', 2012, 2, 8, 8, 15, 15, 15, 1.141, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (163, 6508, 0, 'tom-tube', 'Ganymed - moon of Jupiter. Tom and Dave are building a space station. The base and solar modules have already been constructed. Taking turns, Tom and Dave have to place tubes, move through tubes or space. The astronaut who picks up more valuable counters and returns to his base more quickly with his two solar counters wins the game.<br/>Tom Tube presents a new kind of tessalation with rhombs and triangles, creating a complex, mind puzzling structure of ways through space.<br/><br/>', 2003, 2, 2, 10, 30, 30, 30, 2.2778, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (164, 368045, 0, 'too-many-cooks', 'Too Many Cooks is a co-operative hidden information card game about fussy chefs cooking soups together. It is played in 3 rounds of 5 minutes. You can play in one of 3 difficulty settings; easy, moderate &amp; hard, or you can play through all of them in an hour long session.<br/><br/>You are chefs working together on a delicious soup that satisfies shared culinary tastes. The catch is, each chef has secret personal tastes which must also be sated!<br/><br/>The game starts with a soup base of 16 vegetable card ingredients laid out on the table. Rising to the challenge, players take it in turns to change or move the soup ingredients to satisfy as many tastes as possible before the time runs out.<br/><br/>On your turn you may either: <br/>Change just one aspect of a card - ie its vegetable or colour, by swapping it out for a spare card.<br/>or <br/>Rotate a row or column of vegetables 1 card in either direction.<br/>or <br/>Pass - if your personal tastes and all shared tastes are satisfied.<br/><br/>Of course changes to the soup may upset or satisfy other chef&rsquo;s secret taste sensibilities too! So, players vocalise their satisfaction or dissatisfaction and rotate their taste cards in hand to indicate how happy or unhappy they are after each change to the soup. But they cannot say exactly why. Eg &ldquo;Ewwww, that&rsquo;s disgusting!&rdquo; is fine, but not &ldquo;Ewww, I hate mushrooms!&rdquo; Watch what other chefs seem to be working towards, and try to make changes that make everyone as happy as possible.<br/><br/>Play fast to get your soup kitchen up to a 5 star rating over 3 rounds at your chosen difficulty level. Each of the 3 rounds gets a little harder starting with 7 tastes to solve, moving on to 9, and ending at 11 tastes divided between the players as secret personal tastes (2 each max, or 3 each in the 2 player game) with leftovers placed face up as shared tastes all chefs can work towards together.<br/><br/>&mdash;description from the publisher<br/><br/>', 2022, 2, 6, 10, 20, 20, 20, 0.0, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (165, 40688, 0, 'treasure-chest', 'The 10 year anniversary of alea is celebrated with an expansions box: the Schatzkiste. A medium sized box, containing 10 expansions for 6 alea games.<br/><br/><br/>     New buildings for Puerto Rico<br/>     New buildings for San Juan<br/>     Event Cards for San Juan<br/>     Nine new cards for Notre Dame<br/>     A small set of new events for In the Year of the Dragon<br/>     Building the Chinese wall for In the Year of the Dragon<br/>     Material for a 6th player in Witch''s Brew. This and the next two expansion items are combined in Witch''s Brew: The 6th Player & The Amulets & The Magical Abilities.<br/>     ''Magic abilities'' for Witch''s Brew<br/>     Amulets for Witch''s Brew. For a more exciting game with fewer players.<br/>     A new table for Louis XIV<br/><br/><br/>Released in Germany in April 2009.<br/><br/>The English edition published by Rio Grande Games includes two more items:<br/><br/>     Princess and the Muse expansion for The Princes of Florence<br/>     2-player expansion for The Princes of Florence<br/><br/><br/>', 2009, 2, 6, 9, 75, 75, 75, 2.619, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (166, 234190, 0, 'unstable-unicorns', 'Build a Unicorn Army. Betray your friends. Unicorns are your friends now.<br/><br/>Unstable Unicorns is a strategic card game about everyone&rsquo;s two favorite things: Destruction and Unicorns!<br/><br/>Learn how unstable your friendships really are.<br/><br/>You start with a Baby Unicorn in your Stable. SO CUTE!<br/><br/>But don''t get too attached, because even Baby Unicorns aren''t safe in this game! There are over 20 Magical Unicorns to collect, and each has a special power. Build your Unicorn Army as fast as you can, or be destroyed by one of your so-called friends! Seek revenge or protect your stable using your Magic! Sound easy? Not so fast. Someone could have a Neigh Card (Get it? Neigh?) and send the game into MADNESS! The first person to complete their Unicorn Army shall hereafter be known as The Righteous Ruler of All Things Magical... at least until the next game. Good luck.<br/><br/>--description from the publisher:<br/><br/>', 2017, 2, 8, 8, 45, 30, 45, 1.5325, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (167, 27173, 0, 'vikings', 'Vikings is a fast economic game.  Despite the nominal &quot;Viking&quot; theme, no actual exploration or pillaging is involved.<br/><br/>The resources in the game consist of coins and several types of ship tiles, island tiles and meeples.   In each of 6 rounds, a random set of 12 tiles and 12 meeples becomes available.  Players take turns buying and placing pairs of meeples and tiles.   There is no direct player interaction, only indirect contention for resources during the buying phase.<br/><br/>The most unusual aspect of the game is the pricing wheel, which pairs meeples with tiles and sets their prices.<br/><br/>', 2007, 2, 4, 10, 60, 60, 60, 2.5427, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (168, 2555, 0, 'vom-kap-bis-kairo', 'Players attempt to be the first to build a railway route from Cape to Cairo through various terrain types in Africa. Players begin with 100 pounds, which is used to bid on terrain cards and purchase missing tracks necessary to cross terrain. Each turn, a number of terrain cards equal to the number of players in the game are auctioned off and placed before the appropriate player''s train, representing the next space to be crossed. Terrain cards show a number of tracks ranging from 0 to 3 and require from 6 to 10 tracks to cross depending on the type of terrain. In turn order, players flip additional terrain cards, and decide whether to build (cross terrain) or pass. When a terrain is crossed, the card is flipped face down and the player who completed the crossing receives back a number of pounds as indicated on the card. The track-building phase continues until one player has no terrain cards lying in front of their train, at which time a new set of terrain cards are auctioned. The first player to complete the crossing over eight terrain segments is the winner.<br/><br/>', 2001, 2, 4, 10, 30, 30, 30, 1.8, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (169, 31730, 0, 'wabash-cannonball', 'Wabash Cannonball, which has also been released as Chicago Express, was the first title in Winsome Games'' Historic Railroads System.<br/><br/>In the game, the B&amp;O, C&amp;O, Pennsylvania and New York Central railroads drive from the East Coast across the growing eastern U.S. to Chicago. Smaller, more aggressive railroads like the Wabash spring up to further expand America''s extensive railroads. The sharpest railroad executives vie for the maximum return on their investment in this luck-free business game lasting about one hour.<br/><br/>The game plays out over a maximum of eight rounds. In each round, players take turns choosing one of three available actions:<br/><br/><br/>     Auctioning a share of one of the railroad companies.<br/>     Expanding the rail system of one of the railroad companies.<br/>     Developing one of the board''s hexes.<br/><br/><br/>Each of these actions is available only a limited number of times. As soon as two actions can no longer be chosen, a dividend phase is executed in which all players gain income from the railroad companies of which they have shares. After this dividend phase, the number of actions is reset, and a new round begins.<br/><br/>The game ends after eight rounds or if one of the following conditions is met:<br/><br/><br/>     Three or more companies have no more locomotives.<br/>     Three or more companies have no more shares.<br/>     The general supply contains at most three houses.<br/><br/><br/>At this point, the player with the most money wins.<br/><br/>Note: Some editions of this game have carried a player count of 2-6, while the 2023 Rio Grande Games edition is labeled for 3-6 players. No rules have been changed.<br/><br/>', 2007, 2, 6, 12, 60, 30, 60, 2.7804, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (170, 23450, 0, 'wildfire', 'From the publisher''s website:<br/><br/>Dominoes have never been so WILD! Wildfire Domino game is the newest domino game with wilds and features a unique electronic hub which plays &ldquo;fire&rdquo; sounds in the background. The hub also calls out what the &ldquo;wild&rdquo; numbers are going to be during play. Game includes electronic hub, and unique Wildfire domino set.<br/><br/>', 2005, 2, 8, 0, 60, 60, 60, 2.0, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (171, 266192, 0, 'wingspan', 'Wingspan is&nbsp;a competitive, medium-weight, card-driven, engine-building board game from Stonemaier Games. It''s designed by Elizabeth Hargrave and features over 170 birds illustrated by Beth Sobel, Natalia Rojas, and Ana Maria Martinez.<br/><br/>You are bird enthusiasts&mdash;researchers, bird watchers, ornithologists, and collectors&mdash;seeking to discover and attract the best birds to your network of wildlife preserves. Each bird extends a chain of powerful combinations in one of your habitats (actions). These habitats  focus on several key aspects of growth:<br/><br/><br/>     Gain food tokens via custom dice in a birdfeeder dice tower<br/>     Lay eggs using egg miniatures in a variety of colors<br/>     Draw from hundreds of unique bird cards and play them<br/><br/><br/>The winner is the player with the most points after 4 rounds.<br/><br/>&mdash;description from the publisher<br/><br/>From the 7th printing on, the base game box includes Wingspan: Swift-Start Promo Pack.<br/><br/>', 2019, 1, 5, 10, 70, 40, 70, 2.4588, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (172, 878, 0, 'wyatt-earp', 'The aim of the game for each player to earn the most money from capturing famous outlaws. 2 to 4 players take up the roles of Sheriffs who are hot on the outlaws tails, trying to capture the outlaws with most rewards on their heads.<br/><br/>From the Box:<br/>The Wild West! Tough times and tough characters! Bandits, desperados, rustlers and thieves are everywhere. Take the rolls of the brave sheriffs riding on the heels of these legendary outlaws. Capture Jesse James! Hunt Butch Cassidy and the Sundance Kid! Rich rewards await those brave and daring enough. Just don''t let them slip away...<br/><br/>From the Publisher:<br/>In Wyatt Earp, the players are bounty hunters who work cooperatively and competitively to try to capture the most notorious outlaws of the old west. They do this by collecting and playing sets of cards for the various outlaws. When a player plays a set, he both adds to the reward and improves his chances for collecting the reward for that outlaw. At the end of each hand, players collect money for the outlaws that they helped in capturing. After several hands, the player who has collected the most money in rewards is the winner!<br/><br/>While not officially included, Wyatt Earp is often considered part of the Mystery Rummy series.<br/><br/>This game is #1 in the Alea small box series.<br/><br/>', 2001, 2, 4, 8, 45, 30, 45, 1.841, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (173, 29387, 0, 'zombie-fluxx', 'Zombie Fluxx is the zombie uprising card game with ever-changing rules. There is now a new type of card: Ungoal cards (conditions in which everybody loses!)<br/><br/>Fluxx is a card game where the cards themselves determine the current rules of the game. By playing cards, you change numerous aspects of the game: how to draw cards, how to play cards, and even how to win.<br/><br/>At the start of the game, each player holds three cards and on a turn a player draws one card, then plays one card. By playing cards, you can put new rules into play that change numerous aspects of the game: how many cards to draw or play, how many cards you can hold in hand or keep on the table in front of you, and (most importantly) how to win the game. There are many editions, themed siblings, and promo cards available.<br/><br/>Part of the Fluxx series.<br/><br/>', 2007, 2, 6, 8, 40, 10, 40, 1.4384, '', '');
INSERT INTO Game (id, bggId, expandsGameId, slug, description, publishedIn, minPlayers, maxPlayers, minPlayerAge, playtime, minPlaytime, maxPlaytime, complexity, officialURL, teachingURL) VALUES (174, 27588, 0, 'zooloretto', 'In Zooloretto, each player uses small, large, wild, and exotic animals and their young to try to attract as many visitors as possible to their zoo &ndash; but be careful! The zoo must be carefully planned as before you know it, you might have too many animals and no more room for them. That brings minus points! Luckily, your zoo can expand. A zoo of a family game in which less is sometimes more...<br/><br/>Can be combined with<br/><br/><br/>     Aquaretto<br/>     Zooloretto Mini<br/><br/><br/>', 2007, 2, 5, 8, 45, 45, 45, 1.8579, '', '');
